--insert into whiskey_product values(109, 18, 43, 'SCOTLAND', 'The Aberfeldy Red Wine Cask Limited Edition series is a passion project of Malt Master Stephanie Macleod, with a focus on unique cask finishes that complement and elevate the signature character of Aberfeldy. This limited expression of Aberfeldy 18 Years Old has been finished in Tuscan Red Wine Casks from Bolgheri, Italy. Stephanie uses her exceptional skills in sensory analyses to observe the maturation and flavor development in each cask until achieving the desired flavors, at which time the whisky is deemed ready to be bottled. This is the fourth cask finish in this award-winning series.', 'Aberfeldy 18 Year Old Limited Edition Tuscan Red Wine Cask Finish', 10, 750, 'ABERFELDY', 'HIGHLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(111, 21, 40, 'SCOTLAND', 'Aberfeldy 21 Year Old Single Malt Scotch Whisky is a premium, craft-style scotch whisky that is known as the Golden Dram of alcohol. Abounding in heather honey, creamy macadamia nuts and chewy beeswax, this scotch alcohol is plush with dried fruits, toasted coconut, silky oak and a wee trace of smoke. When you want to share great stories with great friends, enjoy this single malt whisky neat, or chilled on the rocks in your favorite whisky glass. Aberfeldy is hallmarked by their distillery, which is built on land famous for its deposits of gold in the freshwater supply. This scotch liquor is made with 100% malted barley, matured in ex-sherry and ex-bourbon oak casks for 21 years to add overall richness, and labeled with a profound age statement so you know exactly how long it''s been waiting before you take your first sip. Experience the Golden Dram. Enjoy Responsibly.', 'Aberfeldy 21 Year Old', 10, 750, 'ABERFELDY', 'HIGHLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(113, 18, 40, 'SCOTLAND', 'BERFELDY Single Malt Scotch Whisky unveils its latest limited expression, ABERFELDY 18 Years Old, finished in French Wine Casks from Pauillac, Bordeaux.Initially spending 18 years in a combination of refill casks, this whisky has undergone a finishing period of around 4-5 months in first-fill Pauillac wine casks, a rich and complex red wine from Bordeaux.Malt Master Stephanie MacLeod carefully monitored maturation and flavour development in the casks until the desired flavour profile had been achieved. ', 'Aberfeldy 18 Year Old Limited Edition', 10, 750, 'ABERFELDY', 'HIGHLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(116, 24, 40, 'SCOTLAND', 'The Exceptional Cask series is a collection of superlative bottlings from our Single Malt distillery of Aberfeldy specially chosen by our Malt Master, Stephanie Macleod. The Exceptional Cask series demonstrates how Macleod patiently lays the foundations of the entire single malts range, by meticulously nosing and assessing every sample within John Dewar s & Sons extensive cask inventory to monitor maturation and flavor development.', 'Aberfeldy 24 Year Old Exceptional Cask Series', 10, 750, 'ABERFELDY', 'HIGHLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(118, 18, 43, 'SCOTLAND', 'The Aberfeldy Limited Edition Series is a passion project of Malt Master Stephanie Macleod, with a focus on unique cask finishes that complement and elevate the signature character of Aberfeldy. Stephanie uses her exceptional skills in sensory analyses to observe the maturation and flavor development in each cask until achieving the desired flavors, at which time the whisky is deemed ready to be bottled.', 'Aberfeldy 18 Year Old Limited Edition Côte Rôtie French Wine Cask Finish', 10, 750, 'ABERFELDY', 'HIGHLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(120, 16, 40, 'SCOTLAND', 'Aberfeldy 16 Year Old Single Malt Scotch Whisky is a premium, craft-style scotch whisky that is known as the Golden Dram of alcohol. Exhaling honey, citrus and spicy cloves, this scotch alcohol is sherried and full like fruitcake with rich dark chocolate and a soothing, mouth-coating finish. When you want to share great stories with great friends, enjoy this single malt whisky chilled, neat in a whisky glass or in alcohol drinks like an Old Fashioned or Golden Dram cocktail.', 'Aberfeldy 16 Year Old', 30, 750, 'ABERFELDY', 'HIGHLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(122, 16, 40, 'SCOTLAND', 'Aberfeldy 16 Year Old Single Malt Scotch Whisky is a premium, craft-style scotch whisky that is known as the Golden Dram of alcohol. Exhaling honey, citrus and spicy cloves, this scotch alcohol is sherried and full like fruitcake with rich dark chocolate and a soothing, mouth-coating finish. When you want to share great stories with great friends, enjoy this single malt whisky chilled, neat in a whisky glass or in alcohol drinks like an Old Fashioned or Golden Dram cocktail.', 'Aberfeldy 12 Year Old', 30, 750, 'ABERFELDY', 'HIGHLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(125, 16, 40, 'SCOTLAND', 'Crafted to celebrate the special moments and whisky aficionados in life, the Aberfeldy Gold Bar gift pack symbolizes the traces of gold found within Aberfeldy unique water source - the Pitilie Burn. Nestled inside this limited edition you will find Aberfeldy 12 Year Old, the whisky known as "The Golden Dram."', 'Aberfeldy Limited Edition 12 Year Old Gold Bar', 30, 750, 'ABERFELDY', 'HIGHLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(128, 15, 43, 'SCOTLAND', 'The Cabernet Sauvignon wine casks from the Napa Valley bestow berries and spice, imparting a refined blush on Aberfeldy’s honeyed malt in this latest release from the Red Wine Cask Collection.Brimming with fragrant notes of raspberry jam, and parma violets. Then dustings of cinnamon and the alluring aroma of freshly ground coffee beans.', 'Aberfeldy 15-Year-Old Limited Edition Single Malt Scotch Whisky Finished in Napa Valley Cabernet Sauvignon Casks', 30, 750, 'ABERFELDY', 'HIGHLANDS', 'SCOTCH' )
--insert into whiskey_product values(130, 24, 43, 'SCOTLAND', 'The Aberfeldy Exceptional Cask Series is a passion project of Malt Master Stephanie Macleod, in which she carefully monitors maturation and flavour development in each cask until the desired flavours have been achieved, at which time the whisky is deemed ready to be bottled.', 'Aberfeldy 24 Year Old Small Batch Oloroso Sherry Finish', 30, 750, 'ABERFELDY', 'HIGHLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(133, 18, 40, 'SCOTLAND', 'The Exceptional Cask series is a collection of superlative bottlings from our Single Malt distillery of Aberfeldy specially chosen by our Malt Master, Stephanie Macleod. The Exceptional Cask series demonstrates how Macleod patiently lays the foundations of the entire single malts range, by meticulously nosing and assessing every sample within John Dewar s & Sons extensive cask inventory to monitor maturation and flavor development.', 'Aberfeldy 18 Year Old Exceptional Cask Series', 30, 750, 'ABERFELDY', 'HIGHLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(135, 7, 40, 'SCOTLAND', 'The Arran Single Malt selected for this cask strength expression was initially matured in first-fill ex-Bourbon barrels for 7 years before being transferred for secondary maturation into smaller Quarter casks also made of the finest American oak for a further 2 years. The process of transferring our whisky into the smaller 125 liter sized casks for their final 2 years of maturation produces far greater contact between the whisky & oak and a faster, more intense maturation.', 'Arran Quarter Cask "The Bothy"', 10, 750, 'ARRAN', 'ISLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(137, 7, 43, 'SCOTLAND', 'Bottled at 43%, the Barrel Reserve emphasizes the delicious, sweet fruit notes which are the hallmark of our distillery. A fantastic discovery!', 'Arran Barrel Reserve Single Malt', 10, 750, 'ARRAN', 'ISLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(139, 18, 46, 'SCOTLAND', 'The Arran 18 year-old scotch whisky is a wonderfully balanced expression of Arran Single Malt which displays the tremendous depth of character of our Distillery.', 'Arran 18 Year-Old', 10, 750, 'ARRAN', 'ISLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(141, 10, 46, 'SCOTLAND', 'Our classic Arran 10 Year Old Single Malt encompasses the unique taste of the beautiful island we call home and is one of the best single malt whiskies Scotland has to offer.', 'Arran 10 Year-Old', 10, 750, 'ARRAN', 'ISLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(143, 14, 46, 'SCOTLAND', 'The Arran 14 Year-Old is a smooth and richly rewarding expression of the Arran Malt bursting with character and complexity. The extra years of maturation have added a depth of sweetness and spice to create a fully rounded and satisfying dram.', 'Arran 14 Year-Old', 10, 750, 'ARRAN', 'ISLANDS', 'SINGLE_MALT' )
--insert into whiskey_product values(145, 14, 55.8, 'SCOTLAND', 'Matured in some of the finest casks available to the whisky industry, this cask strength 100% Sherry matured Single Malt is both luxurious and elegant with layers of rich sweet spice and oak. Our Master Distiller has worked with producers in some of the most prestigious Sherry Bodegas in Jerez, Spain to select only the best quality casks to be filled with our precious spirit. This bottling is a return to the style of some of the earliest Arran Single Malt, which was mostly matured in Sherry Casks.', 'Arran 14 Year-Old', 10, 700, 'ARRAN', 'ISLANDS', 'SCOTCH' )
--insert into whiskey_product values(147, 14, 55.8, 'SCOTLAND', 'This unique Auchentoshan Lowland Single Malt Whisky has been matured in three different cask types. Moving from American Bourbon to Spanish Oloroso Sherry - and finally Pedro Ximenez Sherry casks - Three Wood is a rich, complex whisky with incredible toffee and sherry oak flavors.', 'Auchentoshan Three Wood Lowland Single Malt Scotch Whisky' , 10, 750, 'AUCHENTOSHAN', 'LOWLANDS', 'SINGLE_MALT', 103 )
--insert into whiskey_product values(149, 12, 40, 'SCOTLAND', 'Made in the Lowlands just outside of the city of Glasgow, Auchentoshan is Distilled Different. Auchentoshan is renowned as being the only distillery in Scotland to use a third still in the production of all of our whiskies, making it unique. This triple distillation produces a versatile, smooth, and light Single Malt Whisky. Auchentoshan 12 Year Old Scotch Whisky is triple distilled then matured for over twelve years.', 'Auchentoshan 12 Year Lowland Single Malt Scotch Whisky' , 10, 750, 'AUCHENTOSHAN', 'LOWLANDS', 'SINGLE_MALT', 58 )
--insert into whiskey_product values(2, 12, 40, 'SCOTLAND', 'Made in the Lowlands just outside of the city of Glasgow, Auchentoshan is Distilled Different. Auchentoshan is renowned as being the only distillery in Scotland to use a third still in the production of all of our whiskies, making it unique. This triple distillation produces a versatile, smooth, and light Single Malt Whisky. Auchentoshan 12 Year Old Scotch Whisky is triple distilled then matured for over twelve years.', 'Auchentoshan American Oak Lowland Single Malt Scotch Whisky' , 10, 750, 'AUCHENTOSHAN', 'LOWLANDS', 'SINGLE_MALT', 43 )
--insert into whiskey_product values(4, 2, 50, 'UNITED_STATES', 'Our 100% Rye Mashbill began with Elbon Rye from Northwest Texas accompanied by crystal, chocolate and roasted rye. Driven by constant curiosity, we distilled our Rye in our copper pot stills, bringing new subtlety and perspective to our approach. Aged in New American & Hungarian Oak and never chill filtered or colored, and bottled at 50% ABV or 100 Proof.', 'Balcones Texas Rye 100' , 10, 750, 'BALCONES', 'TEXAS', 'RYE', 43 )
--insert into whiskey_product values(6, 2, 46, 'UNITED_STATES', 'Our 100% Rye Mashbill began with Elbon Rye from Northwest Texas accompanied by crystal, chocolate and roasted rye. Driven by constant curiosity, we distilled our Rye in our copper pot stills, bringing new subtlety and perspective to our approach. Aged in New American & Hungarian Oak and never chill filtered or colored, and bottled at 50% ABV or 100 Proof.', 'Balcones Texas Pot Still Bourbon' , 10, 750, 'BALCONES', 'TEXAS', 'BOURBON', 36 )
--insert into whiskey_product values(8, 2, 50, 'UNITED_STATES', 'True Blue 100 is made with the same mashbill as Baby Blue - 100% Texas grown & roasted blue corn but allowed to further mature in used oak casks for a much richer spirit that balances the flavors of both blue corn and oak. As such, many Bourbon drinkers, in particular, may gravitate to this powerfully subtle dram.  Since the Bottled-in-Bond Act of 1897, ‘100 proof’ has long stood for quality and authenticity. True Blue 100 carries on that tradition. 100% of the whisky in this bottle was born, raised, and bottled at Balcones–from mash to glass. More approachable than full cask-strength whisky, True Blue 100 retains the depth and complexity of over-proof spirits with the softer edges, supple textures and fuller fruitiness that slight dilution can bring. Rich notes of honeyed citrus, stone fruit and cinnamon and a rich, roasted corn palate. Perfect “as is” or with as much water as you prefer. Never chill filtered or colored.', 'Balcones True Blue 100' , 10, 750, 'BALCONES', 'TEXAS', 'BOURBON', 60 )
--insert into whiskey_product values(10, 2, 47, 'UNITED_STATES', 'True Blue 100 is made with the same mashbill as Baby Blue - 100% Texas grown & roasted blue corn but allowed to further mature in used oak casks for a much richer spirit that balances the flavors of both blue corn and oak. As such, many Bourbon drinkers, in particular, may gravitate to this powerfully subtle dram.  Since the Bottled-in-Bond Act of 1897, ‘100 proof’ has long stood for quality and authenticity. True Blue 100 carries on that tradition. 100% of the whisky in this bottle was born, raised, and bottled at Balcones–from mash to glass. More approachable than full cask-strength whisky, True Blue 100 retains the depth and complexity of over-proof spirits with the softer edges, supple textures and fuller fruitiness that slight dilution can bring. Rich notes of honeyed citrus, stone fruit and cinnamon and a rich, roasted corn palate. Perfect “as is” or with as much water as you prefer. Never chill filtered or colored.', 'Balcones Rumble' , 10, 750, 'BALCONES', 'TEXAS', 'BOURBON', 60 )
--insert into whiskey_product values(12, 2, 53, 'UNITED_STATES', 'Along with our Texas grown & roasted blue corn, this one-of-a-kind whisky is smoked with sun-baked Texas scrub oak using our own secret process.  The result is a whisky full of fresh, youthful corn and light fruit notes married with a bold smokiness.  Whether you like smoky whiskies, or just have a penchant for big, new flavors, Brimstone is sure to be a memorable pour.  Aromas of masa, Texas campfire and powdered sugar backed by stone fruit, peppery spice, and mint. Bold yet balanced, Brimstone is yet another Texas original from Balcones. Never chill filtered or colored, and bottled at 50% ABV or 100 Proof.', 'Balcones Brimstone' , 10, 750, 'BALCONES', 'TEXAS', 'BOURBON', 60 )
--insert into whiskey_product values(14, 2, 53, 'UNITED_STATES', 'A timeless style of malt whisky, Balcones “1” Texas Single Malt is our flagship whisky and breathes new life into centuries of distilling tradition with classic techniques and ingredients adapted for New World tastes. Using the historical Scottish Golden Promise Malted Barley – which fell out of fashion in the late 70’s/early 80’s and was originally used by the biggest household Scotch producers. Aged in both New & Used American, French, and Hungarian Oak which yields a large array of complexity from one cask to another. Opening aromas bear hints of toffee and overripe fruits. On the palate, layers of toasted malt and honey give way to mellow notes of baked pears and apples. A long finish is accompanied by cinnamon and cloves. Never chill filtered or colored and bottled at 53% ABV or 106 Proof.', 'Balcones Texas "1" Single Malt' , 10, 750, 'BALCONES', 'TEXAS', 'SINGLE_MALT', 78 );
--insert into whiskey_product values(16, 2, 53, 'UNITED_STATES', 'Lineage is a marrying of the traditional Scotch Single Malts that have long been an inspiration to us, with innovative approaches to grain and maturation that celebrate Texas provenance. Made from both Scottish and Texas-grown barley and aged in both refill and new oak barrels, Lineage celebrates both old and new traditions.', 'Balcones Lineage Texas Single Malt' , 10, 750, 'BALCONES', 'TEXAS', 'SINGLE_MALT', 49 );
--insert into whiskey_product values(21, 2, 53, 'GERMANY', 'Manufactured by Friedrich Schwartze with over 350 years of distilling tradition, this smooth and all-natural bourbon stands out from its competitors.', 'Bärenjäger Honey Bourbon' , 10, 750, 'BARENJAGER', NULL, 'BOURBON', 37 );
--insert into whiskey_product values(23, NULL, 42.5, 'CANADA', 'Our home is on the edge of the inspiring Canadian wilderness. This is the gateway to Bear Country with miles of unexplored forests, mountains, lakes, and rivers on our doorstep.','Bearface Elementally Aged Triple Oak Canadian Whisky' , 10, 750, 'BEARFACE', NULL, NULL, 44 );
--insert into product_images values(22, 'WHISKEY', 'https://www.reservebar.com/dw/image/v2/BJBF_PRD/on/demandware.static/-/Sites-reservebar-catalog/default/dw9b2d050d/images/b63eebf24886399a8d7836d53f47931f19a64429.jpg?sw=916&sh=1170&sm=fit&q=80', true);
--insert into whiskey_product values(25, NULL, 42.5, 'USA', 'Bulleit Bourbon is inspired by the whiskey pioneered by an old family recipe over 150 years ago. Only ingredients of the very highest quality are used. The subtlety and complexity of Bulleit Bourbon come from its unique blend of rye, corn, and barley malt, along with special strains of yeast and pure Kentucky limestone-filtered water. Due to its especially high rye content, Bulleit Bourbon has a bold, spicy character with a finish that''s distinctively clean and smooth.','Bulleit Single Barrel Bourbon S1B2' , 10, 750, 'BEARFACE', NULL, 'BOURBON', 65 );
--insert into whiskey_product values(27, NULL, NULL, 'USA', 'Bulleit Bourbon® is distilled and aged in small batches. Kentucky limestone-filtered water provides the foundation for the bourbon''s character, while charred American oak barrels lend a smoky backbone. Its subtlety and complexity stem from its unique blend of rye, corn and barley malt, along with special strains of yeast. Because Bulleit Bourbon is especially high in rye content, it has a bold and spicy character with a distinctively smooth, clean finish. The result is placed into a bottle whose design has won awards of its own.','Bulleit Bourbon & Bulleit Rye' , 10, 750, 'BEARFACE', NULL, 'BOURBON', 65 );
--insert into whiskey_product values(31, 10, 45.6, 'UNITED_STATES', 'Bulleit Bourbon 10 Year Old Whiskey allows you to savor its smooth, mellow character and complex finish. With its russet color and oaky aroma, our aged whiskey makes a good first impression before it’s even opened. The flavor profile of our bourbon whiskey combines hints of vanilla and dried fruit for a smooth, mellow finish. Aged in charred American white oak, select Bulleit Bourbon barrels were set aside to age for 10 years. The result is an expression of Bulleit that is smooth in character and has a complex finish. Simply combine our bourbon whiskey with cloves, lemon juice, brown sugar and hot water for a comforting Hot Toddy. Bulleit Bourbon 10 Year Old Whiskey earned a double gold medal at the 2021 San Francisco World Spirits Competition.','Bulleit Bourbon 10 Year Old' , 10, 750, 'BEARFACE', 'KENTUCKY', 'BOURBON', 58 );
--insert into product_images values(32, 'WHISKEY', 'https://www.reservebar.com/dw/image/v2/BJBF_PRD/on/demandware.static/-/Sites-reservebar-catalog/default/dw74fdae61/images/5c517d502f5c40848c15c22b49391e69fa9ada48.jpg?sw=916&sh=1170&sm=fit&q=80', true);
--insert into whiskey_product values(33, 10, 45, 'UNITED_STATES', 'Savor the bold, spicy character of Bulleit 95 Rye Whiskey. With its russet color and aromas of biscuit, spice and dried apricot, our straight rye whiskey makes a good first impression before it''s even opened. Its distinctive taste leads into a generous finish that is long, satiny and woody with a hint of light toffee. The flavor profile of our rye whiskey allows you to enjoy its clean finish that lingers long after the final sip. Simply combine our rye whiskey with sweet vermouth, a dash of bitters and a cherry for a classic Manhattan cocktail. Bulleit 95 Rye Whiskey earned a gold medal at the 2021 San Francisco World Spirits Competition.','Bulleit Rye' , 10, 750, 'BEARFACE', 'KENTUCKY', 'RYE', 41);
--insert into whiskey_product values(35, NULL, 50, 'UNITED_STATES', 'Savor the bold, spicy character of Bulleit 95 Rye Whiskey. With its russet color and aromas of biscuit, spice and dried apricot, our straight rye whiskey makes a good first impression before it''s even opened. Its distinctive taste leads into a generous finish that is long, satiny and woody with a hint of light toffee. The flavor profile of our rye whiskey allows you to enjoy its clean finish that lingers long after the final sip. Simply combine our rye whiskey with sweet vermouth, a dash of bitters and a cherry for a classic Manhattan cocktail. Bulleit 95 Rye Whiskey earned a gold medal at the 2021 San Francisco World Spirits Competition.','Bulleit Bourbon Whiskey Blenders'' Select' , 10, 750, 'BULLEIT', 'KENTUCKY', 'BOURBON', 63);
--insert into whiskey_product values(39, NULL, 45, 'UNITED_STATES', 'Enjoy a royally delicious cocktail in a ready-to-drink can with Crown Royal Washington Apple Canadian Whisky Cocktail. Featuring the signature smoothness of traditional Crown Royal Whisky combined with the sweet-tart flavor of Washington green apples, this cocktail offers an effortlessly delicious way to relax or celebrate. For a refreshing tasting cocktail, simply pour in a glass with ice and garnish with an apple slice. Crown Royal Washington Apple Canadian Whisky Cocktail earned a double gold medal at the 2021 San Francisco World Spirits Competition.','Bulleit Bourbon Whiskey with Two Branded Ceramic Mugs'' Select' , 10, 750, 'BULLEIT', NULL, NULL, 45);
--insert into whiskey_product values(43, NULL, 45, 'UNITED_STATES', 'Bulleit Bourbon is inspired by the whiskey that was pioneered over 150 years ago. Only ingredients of the very highest quality are used. The complexity of Bulleit Bourbon comes from its unique blend of rye, corn, and barley malt, along with special strains of yeast and pure Kentucky limestone-filtered water. Due to its especially high rye content, Bulleit Bourbon has a bold, spicy character with a finish that''s distinctively clean and smooth. Medium amber in color, with gentle spiciness and sweet oak aromas, the mid-palate is smooth with tones of maple, oak, and nutmeg. The finish is long, dry, and satiny with a light-tasting toffee flavor that lingers long after the final sip. Simply combine our bourbon whiskey with cloves, lemon juice, brown sugar and hot water for a comforting Hot Toddy. Bulleit Bourbon earned a gold medal at the 2021 San Francisco World Spirits Competition.','Bulleit Bourbon' , 10, 750, 'BULLEIT', 'KENTUCKY', 'BOURBON', 45);
--insert into whiskey_product values(46, NULL, 39.9, 'UNITED_STATES', 'Treat yourself to Cascade Moon 15YO Barrel Proof, an untouched, barrel strength release from the Cascade Hollow Distillery. Rather than blending this low proof liquid with other whiskies, this alluring rarity has been bottled on its own under the guidance of award winning distiller Nicole Austin, offering a liquid rarely tasted on its own.','Cascade Moon 15 Year Old Barrel Proof' , 10, 750, NULL, NULL, 'BOURBON', 161);
--insert into whiskey_product values(48, NULL, 40, 'SCOTLAND', 'As the newest member to our family, Chivas Regal Extra is the most rich and intense Chivas. With Chivas Regal Extra discover an exceptionally rich and generous Chivas blend, a real tribute to the Chivas'' brothers pioneering mastery in the art of blending legendary and generous whiskies.','Chivas Regal Extra' , 10, 750, 'CHIVAS_REGAL', NULL, 'BLENDED_SCOTCH', 55);
--insert into whiskey_product values(50, NULL, 40, 'SCOTLAND', 'The art of blending whisky is an authentic Scottish craft, with a proud heritage that dates back to the 1850’s. Inspired after a tour of Japan, Colin Scott decided to carefully handcraft a bespoke blend for the Japanese palate. Selecting only the very richest and finest of single malt and grain whiskies, Chivas Regal Mizunara has been selectively finished in Mizunara oak casks.','Chivas Regal Mizunara' , 10, 750, 'CHIVAS_REGAL', NULL, 'BLENDED_SCOTCH', 55);
--insert into product_images values(49, 'WHISKEY', 'https://www.reservebar.com/dw/image/v2/BJBF_PRD/on/demandware.static/-/Sites-reservebar-catalog/default/dw30640096/images/c622d455ad8a479da065d73be5241405915acc7d.jpg?sw=916&sh=1170&sm=fit&q=80', true);
--insert into whiskey_product values(52, NULL, 40, 'SCOTLAND', 'At the heart of Chivas Regal are its Master Blenders. Only five have spent their life’s work mastering the famous house style since 1801. In celebration of their dedication and talent, Chivas hand-selected 5 of their most precious signature single malts: Strathisla, Longmorn, Tormore, Braeval, Allt A’Bhainne. Each one to honor the legacy of five generations of blending excellence. This outstanding blended malt whisky pays tribute to the strength of the vision, commitment and mastery of Charles Howard, of Charles Julian, of Alan Baillie, of Jimmy Lang and of Colin Scott.','Chivas Ultis' , 10, 750, 'CHIVAS_REGAL', NULL, 'BLENDED_SCOTCH', 193);
--insert into whiskey_product values(54, NULL, 40, 'SCOTLAND', 'Chivas Regal 18 includes over 20 of Scotland’s rarest single malt whiskies, aptly described by American whisky writer and author of ''Kindred Spirits 2'', F. Paul Pacult as, “Strength and elegance balanced in harmony... blended Scotch does not get any better than this.”','Chivas 18' , 10, 750, 'CHIVAS_REGAL', NULL, 'BLENDED_SCOTCH', 113);
--insert into whiskey_product values(56, 25, 40, 'SCOTLAND', 'Chivas Regal 25 year Old Original is a rare and exclusive blend of the finest Scotch whiskies, which have all been aged for a minimum of 25 years. Chivas Regal 25 Year Old is available only as a strictly limited release in individually numbered bottles.','Chivas 25' , 10, 750, 'CHIVAS_REGAL', NULL, 'BLENDED_SCOTCH', 425);
--insert into whiskey_product values(60, 12, 40, 'SCOTLAND', 'Chivas Regal 12 year old is an expression of a unique tradition that has continued unbroken since the Chivas Brothers first introduced the world to the rich, smooth Scotch whisky of Chivas Regal.','Chivas 12' , 10, 750, 'CHIVAS_REGAL', NULL, 'BLENDED_SCOTCH', 48);
--insert into whiskey_product values(62, 13, 40, 'SCOTLAND', 'This new blend is uniquely smooth and mellow - this interpretation takes the unrivalled Chivas House style and magnifies the sweet, delicate vanilla notes of this 13 years old scotch whisky by selectively finishing a portion of its blend in American Rye casks.','Chivas 13' , 10, 750, 'CHIVAS_REGAL', NULL, 'BLENDED_SCOTCH', 58);
--insert into whiskey_product values(64, NULL, NULL, 'IRELAND', 'Devlin Irish Whiskey is a traditional Irish Whiskey inspired by heritage. Crafted in small batches, it is distilled in classic pot stills using the finest Irish grains and pure, natural Irish spring water. It is aged to perfection in charred oak casks creating the perfect flavor blend found only in the best Irish Whiskeys.','Devlin Irish Whiskey' , 10, 750, 'DEVLIN', NULL, 'IRISH_WHISKEY', 38);
--insert into whiskey_product values(66, NULL, 45, 'IRELAND', 'One of the newest whiskeys from Ireland, Dublin Ink is triple distilled, made with 50% malt, 50% Irish whiskey grain and Mullaghmesha mountain water. Perfect for sipping neat but also has the strength to stand out in your favorite cocktail. Matured in mesothermal climate, ideal for Irish Whiskey maturation.','Dublin Ink Irish Whiskey' , 10, 750, 'DUBLIN_INK', NULL, 'IRISH_WHISKEY', 62);
--insert into whiskey_product values(70, NULL, 35, 'UNITED_STATES', 'The King of Rock & Roll might also be the  inventor of the most decadent snack this side of the Mississippi, the peanut butter banana and bacon grease sandwich! Legend has it that Elvis'' longtime cook, Pauline Nicholson, may have been the first person to serve Elvis this now famous late-night concoction, and we’re sure glad she did.  Midnight Snack delivers the hunka hunka burning love for peanut butter, banana and bacon flavor you''ve been dreaming of.','Elvis Whiskey Midnight Snack' , 10, 750, 'ELVIS_WHISKEY', 'TENNESSEE', 'FLAVORED_WHISKEY', 40);
--insert into whiskey_product values(72, NULL, 35, 'UNITED_STATES', 'Elvis Presley was a man of many nicknames, including Tiger Man, the King of the Jungle.  Some say it was his dad who first called him Tiger Man, some say it was a fan, either way the name was a perfect fit.  Elvis first performed the song, Tiger Man in concert in Las Vegas in 1969 and continued playing it.','Elvis Tennessee Straight Whiskey' , 10, 750, 'ELVIS_WHISKEY', 'TENNESSEE', 'TENNESSEE_WHISKEY', 58);
--insert into whiskey_product values(74, NULL, 35, 'UNITED_STATES', 'Elvis Presley has long been hailed as the undisputed King of Rock & Roll.  Beginning in 1954, his music, his style and his scandalous dance moves took the country by storm and continued to reign for decades influencing many other artists, including The Beatles. “Nothing affected me until I heard Elvis.  Without Elvis, there would be no Beatles” ~ John Lennon','Elvis Straight Rye Whiskey' , 10, 750, 'ELVIS_WHISKEY', 'SOUTH_CAROLINA', 'RYE', 58);
--insert into whiskey_product values(81, NULL, 40, 'UNITED_STATES', 'Golden Moon Colorado Mugishochu was developed by Master Distiller Stephen Gould, after falling in love with Shochu while living in Japan years ago. Golden Moon Colorado Muishochu is made from 100% two-row barley, koji and yeast. It is fermented and distilled using traditional methods of production. Our barley is grown in Coloraod and the surrounding states and malted near our distillery in Golden Colorado. We use organize brown rice koji. Our water is Rocky Mountain Water from the Clear Creek and Montezuma watersheds. Golden Moon Colorado Muishochu is a unique combination of Japanese Traditions and Rocky Mountain Colorado ingredients, making it a totally unique Muishochu Spirit.','Golden Moon Mugi Shochu' , 10, 750, 'GOLDEN_MOON', NULL, 'SINGLE_MALT', 40);
--insert into whiskey_product values(82, NULL, 46, 'UNITED_STATES', 'Golden Moon Triple is distilled from 1005 malted barley, grown in Colorado in the surrounding states and malted in Golden, Colorado. It is mashed, fermented, distilled at Golden Moon Distillery. It is triple distilled in the Irish Style and aged in New American Oak casks. It is then bottled at 46% ABV (92 Proof). Golden Moon Triple is a uniquely Colorado Whiskey. Golden Moon Triple has a warm, sweet and malty nose reminiscent of lighter Irish whiskey. Smooth, but with just a touch of heat. Sweet, malty, slight caramel and candy notes with a hint of toasted oak on the finish. ','Golden Moon Triple An Irish Style Colorado Single Malt' , 10, 750, 'GOLDEN_MOON', 'COLORADO', 'SINGLE_MALT', 69);
--insert into whiskey_product values(83, NULL, 46, 'UNITED_STATES', 'Golden Moon Colorado Single Malt Whiskey is distilled from 100% malted barley, grown in Colorado and the surrounding states. Our Whiskey is malted in Colorado, aged for a minimum of one year in new oak casks, and then finished in used oak casks. Golden Moon Colorado Single Malt Whiskey is a uniquely Colorado Whiskey.','Golden Moon Colorado Single Malt' , 10, 750, 'GOLDEN_MOON', 'COLORADO', 'SINGLE_MALT', 98);
--insert into whiskey_product values(84, NULL, 46, 'UNITED_STATES', 'Golden Moon Colorado Single Malt – Veteran’s Cask No. 2 is a single cask of our award winning American Single Malt Whiskey. It has been produced and bottled to benefit The Heroic Hearts Project.','Golden Moon Colorado Single Malt - Veterans Cask #2' , 10, 750, 'GOLDEN_MOON', 'COLORADO', 'SINGLE_MALT', 89);
--insert into whiskey_product values(85, NULL, 46, 'UNITED_STATES', 'Golden Moon Colorado Single Malt Whiskey – Veterans’ Cask No. 1 is a single-cask limited release American Single Malt whiskey produced and bottled for Warriors and Quiet Waters.  Warriors & Quiet Waters guides post 9-11 combat veterans and their loved ones to thrive and find peace, meaning, and purpose through fly fishing and other inspirational activities in nature. ','Golden Moon Colorado Single Malt - Veterans Cask #1' , 10, 750, 'GOLDEN_MOON', 'COLORADO', 'SINGLE_MALT', 89);
--insert into whiskey_product values(86, NULL, 46, 'UNITED_STATES', 'Golden Moon Principium is distilled from 100% malted barley, grown in Colorado and the surrounding states, and malted in Golden, Colorado. It is mashed, fermented, distilled at Golden Moon Distillery, and aged in New American Oak casks. It is then bottled at 46% ABV (92 Proof). Golden Moon Principium is a uniquely Colorado Whiskey. Golden Moon Prinicipium has a warm, sweet and malty nose characteristic. Great malt character on the palate, with a nice sweetness, caramelt notes and a spiciness on the finish.','Golden Moon Principium A Colorado Single Malt' , 10, 750, 'GOLDEN_MOON', 'COLORADO', 'SINGLE_MALT', 89);
--insert into whiskey_product values(101, NULL, 46, 'UNITED_STATES', ' ,Just like Jack Daniel’s Tennessee, Gentleman Jack is a balanced whiskey with well-developed traces of vanilla, caramel and almond. An exceptionally smooth Tennessee whiskey with a rich, rewarding taste and a gentle farewell. The first whiskey in the world mellowed twice for ultimate smoothness.','Gentleman Jack with Two Dartington Bar Excellence Whiskey Glasses' , 10, 750, 'JACK_DANIELS', 'TENNESSEE', 'TENNESSEE_WHISKEY', 101);
--insert into whiskey_product values(102, NULL, 46, 'UNITED_STATES', 'Jack Daniel’s Tennessee Cocktail Bitters are made with the finest flavors from around the world. Notes of vanilla and wood work hand in hand with what is in a bottle of Old No. 7, while hints of dark berry, maple and ginger complement the flavors of the whiskey to elevate your favorite cocktail. “These aromatic bitters are made specifically to work with the flavors of Jack Daniel’s. Add a few drops to cocktails that call for bitters and even some that don’t,” says ET Tecosky, Jack Daniel’s U.S. Brand Ambassador. ','Jack Daniel''s® Old Fashioned' , 10, 750, 'JACK_DANIELS', 'TENNESSEE', 'TENNESSEE_WHISKEY', 101);
--insert into whiskey_product values(103, NULL, 46, 'UNITED_STATES', 'Crafted by combining traditional methods with a unique process that’s all its own. Twice mellowed for exceptional smoothness, Gentleman Jack has a crisp, balanced flavor. ','Gentleman Jack® Whiskey Sour' , 10, 473, 'JACK_DANIELS', 'TENNESSEE', 'TENNESSEE_WHISKEY', 168);
--insert into whiskey_product values(104, NULL, 40, 'UNITED_STATES', 'Jack Daniel''s Old No. 7 is a premium Tennessee Whiskey. A warm amber colour with aromas of sweet vanilla, this is a smooth, full-bodied whiskey, with flavours of orange, brown sugar and spice, and a long rich finish. Jack Daniel registered his distillery in 1866, making it the oldest registered distillery in the United States. It''s here in Lynchburg that every drop of Jack Daniel''s Tennessee Whiskey is still produced and bottled today. ','Jack Daniel''s Tennessee Whiskey' , 10, 750, 'JACK_DANIELS', 'TENNESSEE', 'TENNESSEE_WHISKEY', 33);
--insert into whiskey_product values(105, NULL, 35, 'UNITED_STATES', 'Jack Daniel''s Tennessee Fire flavored whiskey specialty is a blend of Jack Daniel’s Tennessee Whiskey and cinnamon liqueur that creates a taste that’s one-of-a-kind and unmistakably Jack. Jack Daniel''s Tennessee Whiskey, on its own, brings flavors of toasted wood, roasted nuts, and vanilla beans. Our proprietary and unique cinnamon liqueur perfectly complements the whiskey flavors by adding warm, indulgent and spicy notes of ground cinnamon, delicate cinnamon bark, and spicy clove. ','Jack Daniel''s Tennessee Fire' , 10, 750, 'JACK_DANIELS', 'TENNESSEE', 'FLAVORED_WHISKEY', 33);
--insert into whiskey_product values(106, NULL, 45, 'UNITED_STATES', 'Sinatra Select pays tribute to Jack’s biggest fan: Frank Sinatra. It is made with our unique “Sinatra Barrels” that have deep grooves, specially carved into their staves to expose the whiskey to extra layers of toasted oak, balanced with our finest Tennessee Whiskey. This added exposure imparts a rich amber color, bold character, and pleasant smokiness, punctuated by an incredibly smooth vanilla finish. Much like Frank, this Whiskey is one of a kind. ','Jack Daniel’s Sinatra Select Tennessee Whiskey' , 10, 1000, 'JACK_DANIELS', 'TENNESSEE', 'TENNESSEE_WHISKEY', 184);
--insert into whiskey_product values(107, NULL, 35, 'UNITED_STATES', 'Jack Daniel''s Tennessee Apple is a blend of Jack Daniel’s Tennessee Whiskey and apple liqueur, creating a taste that’s one-of-a-kind and unmistakably Jack. This blend of Jack Daniel''s Tennessee Whiskey and a unique apple liqueur delivers a refreshingly smooth taste. Try Jack Daniel''s Tennessee Apple in mixed drinks, like Jack Apple Fizz or Jack Apple Mule, or enjoy it on the rocks in your favorite glass. ','Jack Daniel''s Tennessee Apple' , 10, 750, 'JACK_DANIELS', 'TENNESSEE', 'TENNESSEE_WHISKEY', 31);
--insert into whiskey_product values(108, NULL, 35, 'UNITED_STATES', 'Jack Daniel''s Tennessee Honey is a blend of Jack Daniel’s Tennessee Whiskey and honey liqueur, creating a taste that’s one-of-a-kind and unmistakably Jack. The blend of Jack Daniel''s Tennessee Whiskey mixed with a unique honey liqueur delivers a rich, nutty finish. Try Jack Daniel''s Tennessee Honey in mixed drinks, like Tennessee Honey and Lemonade, or enjoy it on the rocks in your favorite glass.','Jack Daniel''s Tennessee Honey' , 10, 750, 'JACK_DANIELS', 'TENNESSEE', 'FLAVORED_WHISKEY', 33);
--insert into whiskey_product values(150, NULL, 53.9, 'UNITED_STATES', 'The Jack Daniel’s Special Release series highlights a limited innovation from the Jack Daniel Distillery, and this year’s may be a little unexpected - a new grain bill from Lynchburg, Tennessee - 100% Malted Barley. Master Distiller Chris Fletcher and his team of whiskey makers set out with a desire to craft a uniquely American Single Malt Whiskey. The 2022 Jack Daniel’s Special Release is a one-of-a-kind experience crafted from 100% malted barley and twice barreled for a complex taste. Bottled in its truest form straight from an Oloroso sherry cask, with the proof ranging from 106.1-107.8.','Jack Daniel''s Twice Barreled 2022 Special Release: American Single Malt Whiskey Finished in Oloroso Sherry Casks' , 10, 750, 'JACK_DANIELS', 'TENNESSEE', 'SINGLE_MALT', 81);
--insert into whiskey_product values(151, NULL, 47, 'UNITED_STATES', 'Jack Daniel''s Single Barrel Select Tennessee Whiskey is a unique whiskey from Jack Daniel Distillery. Only one of every 100 barrels is set aside to mature in the highest reaches of Jack’s barrel houses where dramatic temperature changes cause the whiskey to interact more with the handmade, oak whiskey barrels. This develops a robust character and one-of-a-kind flavor.','Jack Daniel''s Single Barrel Select' , 10, 750, 'JACK_DANIELS', 'TENNESSEE', 'BOURBON', 55);
--insert into whiskey_product values(152, 12, 53.5, 'UNITED_STATES', 'Let’s raise a glass of Jack Daniel’s 12-Years-Old Tennessee Whiskey to men & women at Jack Daniel Distillery who crafted these new expressions in the Jack Daniel’s Age Series. We think you’ll agree, it’s well worth the wait.','Jack Daniel’s 12 Years-Old Tennessee Whiskey' , 10, 750, 'JACK_DANIELS', 'TENNESSEE', 'TENNESSEE_WHISKEY', 92);
--insert into whiskey_product values(153, NULL, 46, 'UNITED_STATES', 'Jack Daniel''s Single Barrel Tennessee Rye Whiskey features a truly unique grain bill of 70% rye, 18% corn and 12% malted barley. This Tennessee Rye Whiskey features complex flavors of ripe fruit and light toasted oak notes to create a spicy rye taste with a pleasant, lingering finish.','Jack Daniel''s Single Barrel Rye' , 10, 750, 'JACK_DANIELS', 'TENNESSEE', 'RYE', 55);
--insert into whiskey_product values(154, NULL, 50, 'UNITED_STATES', 'Jack Daniel’s Bonded Tennessee Whiskey is a big, bold Tennessee whiskey bottled at 100 proof. This American whiskey delivers layered flavor notes of caramel, rich oak and spice giving way to a pleasantly lingering finish with a hint of smoke. Enjoy this whiskey liquor on the rocks or in mixed drinks like a Boulevardier. This edition of Jack is one you can enjoy when you''re out with friends or when you''re relaxing after a long week.','Jack Daniel’s Bonded Tennessee Whiskey' , 10, 750, 'JACK_DANIELS', 'TENNESSEE', 'TENNESSEE_WHISKEY', 35);
--insert into whiskey_product values(155, NULL, 45, 'UNITED_STATES', 'Jack Daniel''s Tennessee Rye Whiskey combines the distinct flavor of rye with the one-of-a-kind taste of classic Jack Daniel''s Whiskey. This American whiskey is made with a uniquely crafted 70-percent rye grain bill, natural spring water from Jack Daniel''s own Cave Spring Hollow, and a time-honored charcoal mellowing process that results in a bold, spicy Rye Whiskey that''s sippin'' smooth.','Jack Daniel''s Tennessee Rye' , 10, 750, 'JACK_DANIELS', 'TENNESSEE', 'RYE', 36);
--insert into whiskey_product values(166, NULL, 43, 'IRELAND', 'We’re not sure if our Head Blender, Billy Leighton, has a musical note in his head, but harmony is his main pursuit. The Blender’s Dog is a whiskey that celebrates his craft, the art of marrying whiskeys. A superbly balanced, complex whiskey, The Blender’s Dog is a perfect balance of spirit, wood, and time; delivering butterscotch sweetness with a prickle of spice and tannins. Making whiskey requires a fair deal of science, but blending is an art.','Jameson Blender''s Dog - The Whiskey Makers Series' , 10, 750, 'JACK_DANIELS', 'TENNESSEE', 'TENNESSEE_WHISKEY', 101);
--insert into whiskey_product values(167, 18, 40, 'UNITED_STATES', 'Matured for 18 years in hand-selected oak casks from Europe and America, this rare whiskey is finished in first-fill bourbon barrels. This rite of passage introduces subtle traces of vanilla to an exceptionally balanced, mellow whiskey with a lingering finale of wood, spice and toffee. An elder statesman of our portfolio, each bottle of this unique whiskey is individually numbered.','Jameson 18 Year Old Irish Whiskey' , 10, 750, 'JACK_DANIELS', NULL, 'IRISH_WHISKEY', 169);
--insert into whiskey_product values(168, NULL, 46, 'IRELAND', 'We had a hunch that a zesty IPA would be the perfect partner for our whiskey, so we loaned barrels to our drinking buddies to make a Jameson-seasoned IPA. The beer-soaked barrels returned to the distillery full of new crisp, hoppy notes. We re-filled them with Jameson, and the wait began. Our signature smoothness is still there, but now thanks to the IPA it’ll be rubbing shoulders light hints of hops, fresh citrus and floral notes.','Jameson Caskmates IPA Edition' , 10, 750, 'JACK_DANIELS', NULL, 'IRISH_WHISKEY', 39);
--insert into whiskey_product values(169, NULL, 40, 'IRELAND', 'An experimental edition whiskey, Jameson Caskmates is traditional Jameson Irish Whiskey finished in craft beer barrels. Caskmates has the triple-distilled smoothness of Jameson with a once-stouted, truly unique finish.The taste of the Irish pot still whiskey is complemented by the effect of time spent in the beer cask, which brings subtle flavors of butterscotch, cocoa beans, and hops. Hints of marzipan and charred oak add to the whiskey''s deep flavor.','Jameson Caskmates Stout Edition' , 10, 750, 'JAMESON', NULL, 'IRISH_WHISKEY', 35);
--insert into whiskey_product values(170, NULL, 46, 'IRELAND', 'Jameson Irish whiskey is a triple-distilled blended Irish whiskey, as versatile as it is smooth. First, we take the best of pot still and fine grain whiskeys. Then we triple distill them. Not because we have to, because we want to - this gives Jameson its signature smoothness. This tradition began in 1780 with John Jameson, and we continue his legacy to this day. Finally, we age our whiskey in oak casks for a minimum of 4 years. The result? A unique whiskey with a perfect balance of spicy, nutty and vanilla notes with hints of sweet sherry. We always like to say that everything you need to know about Jameson is right here - either on our bottle or in our bottle - encapsulating our full story. The label features our family crest and motto. Proclaiming ‘Sine Metu'', it means ‘Without Fear''. It''s the reason John Jameson first triple distilled Irish whiskey, creating Jameson Irish Whiskey as we know it. So in the spirit of Sine Metu, let us take you on a journey. Pull up a chair…','Jameson Irish Whiskey' , 10, 750, 'JAMESON', NULL, 'IRISH_WHISKEY', 35);
--insert into whiskey_product values(171, NULL, 40, 'IRELAND', 'Jameson Black Barrel Irish Whiskey is a tribute to our coopers, who painstakingly give their barrels an additional charring to reveal their untold richness and complexity. Charring is an age-old method for invigorating barrels to intensify the taste. Time spent maturing in these double-charred barrels lends our whiskey a unique richness, with more intensified notes of vanilla sweetness and caramel, alongside toasted wood, fruit, and warm spice. We always like to say that everything you need to know about Jameson is right here - either on our bottle or in our bottle -encapsulating our full story. The label features our family crest and motto. Proclaiming ‘Sine Metu'', it means ‘Without Fear''. It''s the reason John Jameson first triple distilled Irish whiskey, creating Jameson Irish Whiskey as we know it. So in the spirit of Sine Metu, let us take you on a journey. Pull up a chair….','Jameson Black Barrel' , 10, 750, 'JAMESON', NULL, 'IRISH_WHISKEY', 47);
--insert into whiskey_product values(172, NULL, 46, 'IRELAND', 'At Jameson, we’ve been bringing neighborhoods together since 1780. This year we brought Revolution Brewing to Ireland to brew a batch of their signature Fist City Pale Ale. This beer was used to season Jameson barrels which were then used to finish Jameson – and make the Jameson Caskmates Revolution Brewing Limited Edition.','Jameson Caskmates Revolution Brewing Edition Irish Whiskey' , 10, 750, 'JAMESON', NULL, 'IRISH_WHISKEY', 37);
--insert into whiskey_product values(173, NULL, 40, 'IRELAND', 'Jameson Caskmates IPA Edition introduces an exciting new variation on the Caskmates formula, first developed when Jameson''s Head of Whiskey Science and a head brewer decided to try aging the triple-distilled, blended Irish whiskey in Irish stout beer barrels. The Stout Edition was so successful, they were excited to find Jameson''s next great caskmate. Now, fans of Irish Pale Ales have a Jameson whiskey to call their own. This edition follows the same Caskmates blueprint, swapping out the stout barrels for IPA-seasoned barrels. The result is a unique whiskey with a floral, hoppy nose, distinct hop and herb flavors, and a signature smooth finish that could only come from Jameson. Caskmates IPA edition is the ideal whiskey gift for craft beer fanatics, and pairing this whiskey with your favorite pale ale is a perfect way to enjoy. Drink neat or on the rocks, and let this Irish whiskey innovation speak for itself.','Jameson Caskmates Topcutter IPA Edition Irish Whiskey' , 10, 750, 'JAMESON', NULL, 'IRISH_WHISKEY', 38);
--insert into whiskey_product values(174, NULL, 30, 'IRELAND', 'Jameson Orange combines the finest triple-distilled Jameson Irish Whiskey with natural orange flavoring. The result is a deliciously smooth, naturally zesty, subtly sweet and perfectly balanced expression. Bottled at 30% ABV and bursting with flavor, the new release introduces a whiskey-focused, modern, low-sugar twist to the growing flavored spirits category. Try it over ice or with lemon-lime soda and an orange wedge for a crisp and refreshing drink.','Jameson Orange' , 10, 750, 'JAMESON', NULL, 'IRISH_WHISKEY', 31);
--insert into whiskey_product values(177, NULL, 41, 'JAPAN', 'Kikori is a whiskey for those who take the road less traveled in order to find new and exciting experiences. It’s a brand for the curious, the active, the never-sit-still types who are always looking for ways to break up their normal routine. Kikori is here so you can discover something new and share that experience with friends and family.','Kikori Japanese Rice Whiskey' , 10, 750, 'KIKORI', NULL, 'BLENDED_WHISKEY', 50);
--insert into whiskey_product values(179, NULL, 40, 'JAPAN', 'Masahiro Pure Malt Whisky is a reflection of the dedication to masterful distilling and blending dating back to the founding of our distillery in 1883. A marriage of 100% malted barley whiskies distilled and matured at Masahiro blended with magnificent world malt whisky, Masahiro Pure Malt is finished in first-fill Jack Daniel''s barrels, imparting notes of vanilla, coconut and all-spice, making it an exceptional example of Masahiro’s whisky craftsmanship.','Masahiro Pure Malt Whisky' , 10, 750, 'MASAHIRO', NULL, 'BLENDED_WHISKEY', 73);
--insert into whiskey_product values(182, 6, 48.5, 'UNITED_STATES', 'A bold homage to the original artisanal whiskies of America, Old Potrero Rye Whiskey is a testament to the power of the pioneering spirit and the celebrated return of pot-distilled whiskey in the United States. Created by Fritz Maytag, the same beverage visionary who sparked the craft beer movement with his purchase of Anchor Brewing in 1965 and the founder of the original Anchor Distilling Co., now Hotaling & Co., Old Potrero is credited as the first American craft whiskey to hit the market since Prohibition. Distilled in San Francisco, Old Potrero is 100% pot distilled with a 100% malted rye mash bill. It’s 48.5% ABV and our take on America’s original whiskey.','Old Potrero Straight Rye Whiskey 6 Year Old' , 10, 750, 'OLD_POTRERO', NULL, 'RYE', 65);
--insert into whiskey_product values(183, NULL, 40, 'UNITED_STATES', 'Old Potrero Rye Whiskey is a bold homage to the original artisanal whiskeys of America, a testament to the power of the pioneering spirit and the celebrated return of pot-distilled whiskey in the United States. Since 1993, the whiskey has been distilled in small copper pot stills at the San Francisco-based distillery. Credited as the first legal American craft rye whiskey to hit the market since prohibition, Old Potrero recently underwent a complete brand re-launch in 2022, featuring new packaging and bottle design. This limited expression features the newly designed packaging and bottle geared towards today''s contemporary whiskey drinker, who appreciates an excellent dram with an iconic heritage and a modern-day appeal.','Old Potrero Single Barrel Straight Rye Whiskey S1B45' , 10, 750, 'OLD_POTRERO', NULL, 'RYE', 106);
--insert into whiskey_product values(185, NULL, 40, 'UNITED_STATES', 'Colkegan is a true American Single Malt, it''s subtle Mesquite Smokey notes make it stand out above all other single malts. Aged in new and used American white oak casks, and with just 1/3rd of the oak mesquite smoked, this is truly a unique whiskey with lots of complexity, yet approachable flavors.','Colkegan American Single Malt' , 10, 750, 'SANTA_FE_SPIRITS', 'NEW_MEXICO', 'SINGLE_MALT', 60);
--insert into whiskey_product values(198, NULL, 40, 'UNITED_STATES', 'This single barrel is different. It has the most distinct flavor profile of any of our whiskeys and was bottled at barrel strength to capture every nuance of this one-of-a-kind spirit. Our distillery’s triple filtration process ensures perfection in every sip. Distilled, aged and bottled in middle Tennessee, home of premier master distiller and teacher, Nearest Green.','Uncle Nearest Single Barrel Whiskey' , 10, 750, 'UNCLE_NEAREST', 'TENNESSEE', NULL,  79);
--insert into whiskey_product values(199, NULL, 40, 'UNITED_STATES', 'Our inaugural Straight Bourbon Whiskey, Uncle Nearest 1856 is an award-winning blend, bottled at 100 proof. It is astonishingly smooth and can be enjoyed neat, on the rocks, or in your favorite whiskey cocktail. This legacy-era bottling contains whiskey from our own barrels – distilled, aged and bottled in middle Tennessee – and we couldn''t be more proud to share it with you.  ','Uncle Nearest 1856 Premium Aged Whiskey with 4 Markham Marquis by Waterford Double Old Fashioned Glasses' , 10, 750, 'UNCLE_NEAREST', 'TENNESSEE', 'TENNESSEE_WHISKEY', 188);
--insert into whiskey_product values(200, NULL, 50, 'CANADA', 'This was a lofty experiment that worked. The result is a Straight Rye Whiskey made from a 100-percent rye mash bill, secondarily matured in used Uncle Nearest barrels before being bottled at 100-proof. It keeps with our tradition of creating some of the most awarded whiskeys in the world. This is Straight Rye Whiskey, elevated, hitting every mark with its rich flavor profile, incredible balance of spices, and extraordinarily smooth finish.','Uncle Nearest Straight Rye Whiskey' , 10, 750, 'UNCLE_NEAREST', NULL, 'BLENDED_WHISKEY', 59);
--insert into whiskey_product values(201, NULL, 40, 'UNITED_STATES', 'Description: Uncle Nearest 1884 Small Batch Whiskey is a 93-proof whiskey distilled, aged and bottled entirely by Uncle Nearest. Each batch is curated by 5th generation Nearest Green descendant and our Master Blender, Victoria Eady Butler, who has been named Master Blender of the Year four times over.','Uncle Nearest 1884 Small Batch Whiskey' , 10, 750, 'UNCLE_NEAREST', NULL, 'TENNESSEE_WHISKEY', 62);
--insert into whiskey_product values(202, NULL, 40, 'UNITED_STATES', 'Uncle Nearest 1884 Small Batch Whiskey is a 93-proof whiskey distilled, aged and bottled entirely by Uncle Nearest. Each batch is curated by 5th generation Nearest Green descendant and our Master Blender, Victoria Eady Butler, who has been named Master Blender of the Year four times over. 1884 Small Batch presents with a lively nose of honey, warm brown sugar, cedar, orange peel, tobacco flower, ground ginger and white pepper. On the palate, it warms, showing caramel balanced with spicy wood tannins, with notes of baking chocolate, cigar leaf, nougat and cinnamon. The finish is long and smooth. The cinnamon lingers with dark chocolate, oak tannins and maple syrup. A fantastic sipper, yet versatile enough for all your favorite cocktails.','Uncle Nearest 1884 Small Batch Whiskey with 4 Markham Marquis by Waterford Double Old Fashioned Glasses' , 10, 750, 'UNCLE_NEAREST', NULL, 'TENNESSEE_WHISKEY', 118);
--insert into whiskey_product values(203, NULL, 40, 'UNITED_STATES', 'Our inaugural Straight Bourbon Whiskey, Uncle Nearest 1856 is an award-winning blend, bottled at 100 proof. It is astonishingly smooth and can be enjoyed neat, on the rocks, or in your favorite whiskey cocktail. This legacy-era bottling contains whiskey from our own barrels – distilled, aged and bottled in middle Tennessee – and we couldn''t be more proud to share it with you.','Uncle Nearest 1856 Premium Aged Whiskey' , 10, 750, 'UNCLE_NEAREST', NULL, 'BLENDED_WHISKEY', 62);
--insert into whiskey_product values(205, NULL, 40, 'UNITED_STATES', 'Distilled in a rare Alambic pot still from Cognac, “First Run” by Wolves is a decadent and balanced blend of California whiskeys.  It is comprised of (1) whiskey distilled from craft Stout beer, aged in French Oak for 8 years, (2) whiskey distilled from craft Pilsner beer, aged in New American Oak for 5 years, and (3) a Rye selected for its spice to round out the back palate','Wolves First Run' , 10, 750, 'WOLVES', 'CALIFORNIA', NULL,  154);
--insert into whiskey_product values(212, 12, 43, 'JAPAN', 'The Pioneer of Japanese whisky. Yamazaki is Suntory''s flagship single malt, multi-layered with fruit and Mizunara aromas. Succulent with soft fruit.Color: pure gold. Nose: peach, pineapple, grapefruit, clove, candied orange, vanilla, Mizunara (Japanese oak) Palate: coconut, cranberry, butter. Finish: sweet ginger, cinnamon, long finish.Yamazaki is multi-layered with fruit and Mizunara aromas. The palate presents coconut, cranberry, and butter. The finish is long with sweet ginger and cinnamon.','Yamazaki 12 Year Old Single Malt Japanese Whisky' , 10, 750, 'YAMAZAKI',  NULL, 'SINGLE_MALT',  215);
--insert into whiskey_product values(213, 55, 46, 'JAPAN', 'Fifth Generation Chief Blender Shinji Fukuyo believes there are both young and late bloomers. The House of Suntory has always believed that like people, each whisky has its own narrative. Each whisky celebrates its own peak regardless of age. With Yamazaki 55, Fukuyo faced a challenge confronting the complexity of working with rare old whiskies. When he acknowledged imperfections in the casks of 1964, the challenge was to enhance the potential of these late bloomers, to unveil a Yamazaki-ness not known before. Fukuyo worked closely at hand with Shingo Torii, Third Generation Master Blender, to find the right creative alchemy and master the signature art of blending to properly reveal the particular depth, complexity and wisdom that is Yamazaki 55. What Fukuyo respected throughout this process was a combination of the passage of time and what the Japanese refer to as Wabisabi – the imperfections that make up perfection.','Yamazaki 55 Year Old Single Malt Japanese Whisky' , 10, 750, 'YAMAZAKI',  NULL, 'SINGLE_MALT',  800);
--insert into whiskey_product values(230, NULL, 40, 'UNITED_STATES', 'Introducing Jim Beam® Distiller’s Cut. From barrels personally selected by Fred himself, Jim Beam® Distillers Cut Bourbon is only quality screened to remove barrel char pieces from the liquid.','Jim Beam Distiller’s Cut Bourbon Whiskey' , 10, 750, 'JIM_BEAM', 'KENTUCKY', 'BOURBON',  40);
--insert into whiskey_product values(231, NULL, 47.5, 'UNITED_STATES', '220 years of experience goes into every bottle of Jim Beam Bourbon. An aging process of four years in new charred oak barrels gives Jim Beam its elegant, refined and smooth character. Jim Beam''s extra aging creates an elegant, smooth and refined whiskey that pleases with every sip. After seven generations and 30 family members of master distillers, the Jim Beam family tradition continues today.','Jim Beam Single Barrel Bourbon Whiskey' , 10, 750, 'JIM_BEAM', 'KENTUCKY', 'BOURBON',  47);
--insert into whiskey_product values(232, NULL, 50, 'UNITED_STATES', 'This bourbon adheres to the requirements of the Bottled in Bond Act of 1897, which includes a minimum of four years aging and a bottling at 100 proof. Jim Beam® Bonded was originally created for bartenders as a superior mixing whiskey with fuller body and flavor. We add less water to this bourbon, so it’s closer to barrel strength, resulting in an enhanced flavor that stands up to the most complex cocktails.','Jim Beam Bonded Bourbon Whiskey' , 10, 750, 'JIM_BEAM', 'TENNESSEE', 'BOURBON',  40);
--insert into whiskey_product values(233, NULL, 40, 'UNITED_STATES', '220 years of experience goes into every bottle of Jim Beam Bourbon. An aging process of four years in new charred oak barrels gives Jim Beam its elegant, refined and smooth character. Jim Beam''s extra aging creates an elegant, smooth and refined whiskey that pleases with every sip. After seven generations and 30 family members of master distillers, the Jim Beam family tradition continues today. In 2005, Frederick Booker Noe III, the great-grandson of Jim Beam, filled the 10 millionth barrel of Jim Beam, keeping the tradition of Jacob Beam alive for the next generation of bourbon drinkers','Jim Beam Rye Whiskey' , 10, 750, 'JIM_BEAM', 'KENTUCKY', 'RYE',  40);
--insert into whiskey_product values(234, NULL, 40, 'UNITED_STATES', 'Before Jim Beam Bourbon, the Beam family made Old Tub, an unfiltered bonded bourbon which was the foundation for what would become the world''s number one bourbon. This limited-edition bourbon is a tribute to the groundbreaking whiskey.','Old Tub Kentucky Straight Bourbon Whiskey' , 10, 750, 'JIM_BEAM', 'KENTUCKY', 'RYE',  777);
--insert into whiskey_product values(235, NULL, 43, 'UNITED_STATES', '220 years of experience goes into every bottle of Jim Beam Bourbon. An aging process of four years in new charred oak barrels gives Jim Beam its elegant, refined and smooth character. Jim Beam''s extra aging creates an elegant, smooth and refined whiskey that pleases with every sip. After seven generations and 30 family members of master distillers, the Jim Beam family tradition continues today. In 2005, Frederick Booker Noe III, the great-grandson of Jim Beam, filled the 10 millionth barrel of Jim Beam, keeping the tradition of Jacob Beam alive for the next generation of bourbon drinkers','Jim Beam Black Bourbon Whiskey' , 10, 750, 'JIM_BEAM', 'KENTUCKY', 'BOURBON', 45);
--insert into whiskey_product values(236, NULL, 43, 'UNITED_STATES', '220 years of experience goes into every bottle of Jim Beam Bourbon. An aging process of four years in new charred oak barrels gives Jim Beam its elegant, refined and smooth character. Jim Beam''s extra aging creates an elegant, smooth and refined whiskey that pleases with every sip. After seven generations and 30 family members of master distillers, the Jim Beam family tradition continues today.','Jim Beam Double Oak Bourbon Whiskey' , 10, 750, 'JIM_BEAM', 'KENTUCKY', 'BOURBON',  40);
--insert into whiskey_product values(237, NULL, 40, 'UNITED_STATES', '225 years of experience goes into every bottle of Jim Beam Bourbon. An aging process of four years in new charred oak barrels gives Jim Beam its elegant, refined and smooth character. With a slightly spicy, oaky vanilla aroma, this medium-bodied bourbon brings mellow hints of caramel, vanilla, grain and oak flavor with a lightly sweet, toasted oak finish. Sip it neat, on the rocks or mix it up in any number of bourbon- or whiskey-centered cocktails like a Spring Breeze or Berry Julep. Jim Beam''s extra aging creates an elegant, smooth and refined whiskey that pleases with every sip. After seven generations and 30 family members of master distillers, the Jim Beam family tradition continues today.','Jim Beam Bourbon Whiskey' , 10, 750, 'JIM_BEAM', 'KENTUCKY', 'BOURBON',  36);
--insert into whiskey_product values(238, NULL, 32.5, 'UNITED_STATES', '220 years of experience goes into every bottle of Jim Beam Bourbon. An aging process of four years in new charred oak barrels gives Jim Beam its elegant, refined and smooth character. Jim Beam''s extra aging creates an elegant, smooth and refined whiskey that pleases with every sip. After seven generations and 30 family members of master distillers, the Jim Beam family tradition continues today. In 2005, Frederick Booker Noe III, the great-grandson of Jim Beam, filled the 10 millionth barrel of Jim Beam, keeping the tradition of Jacob Beam alive for the next generation of bourbon drinkers. Barrel aged whiskey with notes of clove, cinnamon, licorice, mint, and gingersnaps.','Jim Beam Peach Bourbon' , 10, 750, 'JIM_BEAM', 'KENTUCKY', 'BOURBON',  22);
--insert into whiskey_product values(239, NULL, 45, 'UNITED_STATES', '220 years of experience goes into every bottle of Jim Beam Bourbon. An aging process of four years in new charred oak barrels gives Jim Beam its elegant, refined and smooth character. Jim Beam''s extra aging creates an elegant, smooth and refined whiskey that pleases with every sip. After seven generations and 30 family members of master distillers, the Jim Beam family tradition continues today. In 2005, Frederick Booker Noe III, the great-grandson of Jim Beam, filled the 10 millionth barrel of Jim Beam, keeping the tradition of Jacob Beam alive for the next generation of bourbon drinkers.','Jim Beam Devil''s Cut Bourbon Whiskey' , 10, 750, 'JIM_BEAM', 'KENTUCKY', 'BOURBON',  40);
--insert into whiskey_product values(240, NULL, 40, 'UNITED_STATES', 'Red Stag by Jim Beam® Black Cherry has a balance of soft, dark cherry aromas backed by traditional bourbon oak. The palate finishes with warm, black cherry and smooth bourbon notes. ','Jim Beam Red Stag Black Cherry Bourbon Whiskey' , 10, 750, 'JIM_BEAM', 'KENTUCKY', 'BOURBON', 32);
