--insert into whiskey_product values(248, NULL, 40, 'SCOTLAND', 'It''s said that centuries ago, the fateful prophecy of an ancient seer living on the Isle of Jura came to be. To mark the legend, the seer''s symbol watches over every bottle.','Jura Prophecy' , 10, 750, 'JURA', 'ISLANDS', 'SINGLE_MALT',  83);
--insert into whiskey_product values(249, 12, 40, 'SCOTLAND', 'Jura 12 Year Old is the latest addition to the Jura portfolio. It is matured in American White Oak ex-bourbon barrels for 12 years and finished in Oloroso Sherry casks from Jerez, Spain. ','Jura New' , 10, 750, 'JURA', 'ISLANDS', 'SINGLE_MALT',  57);
--insert into whiskey_product values(250, 18, 40, 'SCOTLAND', 'Jura 18 Year Old Single Malt Scotch whisky is matured for eighteen long years in American white oak ex-Bourbon barrels and enriched by superior Premier Grand Cru Classé Bordeaux barrels. It is a rich island malt with refined, subtle smoky notes that will complete any whisky collection.','Jura 18 Year Old' , 10, 750, 'JURA', 'ISLANDS', 'SINGLE_MALT',  136);

