--insert into wine_product values(260, 11.5, 40, 'ITALY', 'Accademia Prosecco DOC is ideal as an aperitif and in a cocktail. It is best served with fish starters and risotto; it is also an all-around wine which goes particularly well with wild herbs, meat, pizza, cold cuts and cheeses.','Accademia Orange' , 10, 750, 'ACCADEMIA', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  23);
--insert into wine_product values(261, 11.5, 40, 'ITALY', 'Accademia prosecco brut DOC, produced with the Martinotti method, incorporates the characteristics that have made the world-famous sparkling wines: lively, elegant and versatile.','Accademia Purple' , 10, 750, 'ACCADEMIA', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  23);
