--insert into wine_product values(259, 11.5, 40, 'ITALY', 'Accademia prosecco brut DOC, produced with the Martinotti method, incorporates the characteristics that have made the world-famous sparkling wines: lively, elegant and versatile. Accademia Prosecco DOC is ideal as an aperitif and in a cocktail. It is best served with fish starters and risotto; it is also an all-around wine which goes particularly well with wild herbs, meat, pizza, cold cuts and cheeses.','Accademia Yellow' , 10, 750, 'ACCADEMIA', 'CALIFORNIA', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  23);
--insert into wine_product values(273, 11.5, 1, 'UNITED_STATES', 'This Beckstoffer Georges III sports intense aromatics of licorice, shaved dark chocolate, ripe red fruits and pencil lead. On the palate, an explosion of crushed blackberries and toffee mix with forest floor and graphite. Super fine dusty tannins add focus and length to the extended finish.','Adobe Road Cabernet Beckstoffer' , 10, 750, 'ADOBE_ROAD_WINERY', 'CALIFORNIA', 'RED_WINE', 'CABERNET_SAUVIGNON',  199);
--insert into wine_product values(274, 11.5, 1, 'ITALY', 'The 24 is a Rhone-style blend of Grenache, Mourvedre, and Syrah, with Malbec for added spice and character. The beautiful metal chronograph label on the front pays homage to the Rolex timepiece which counts down the thrilling, 24-hour races at Daytona and Le Mans. ','Adobe Road The 24 Red Blend' , 10, 750, 'ADOBE_ROAD_WINERY', 'CALIFORNIA', 'RED_WINE', 'RED_BLEND',  75);
--insert into wine_product values(275, 14.5, 1, 'ITALY', 'Blue Dog comes bounding out of the glass with loads of fresh blackberries, black plums, and warm strawberry compote.  Silky tannins frame the anise and ripe fig complexities on the decadently layered palate, with a black pepper spice on the long finish.  From front to back this wine feels luxurious.','Adobe Road Wines The Blue Dog Cabernet Sauvignon' , 10, 750, 'ADOBE_ROAD_WINERY', 'CALIFORNIA', 'RED_WINE', 'CHAMPAGNE',  76);
--insert into wine_product values(276, 17.5, 1, 'UNITED_STATES', 'Apex pours a dark purple-black into the glass. Licorice, plums, wet stones and blackberries lead the way, with smoked meat and wild blueberries framed by medium-firm tannins.','Adobe Road Wines Apex' , 10, 750, 'ADOBE_ROAD_WINERY', 'CALIFORNIA', 'RED_WINE', 'RED_BLEND',  170);
--insert into wine_product values(277, 11.5, 1, 'UNITED_STATES', 'Redline jumps out of the glass with ripe blackberries, black cherry, licorice, and a hint of toasty oak. A broad mouthfeel meets ultra plush texture on the palate, delivering chocolate covered blueberries and blackberry pie with wafts of hardwood charcoal grill. Silky tannins frame the incredibly smooth finish.','Adobe Road Redline Sonoma' , 10, 750, 'ADOBE_ROAD_WINERY', 'CENTRAL_COAST', 'RED_WINE', 'CABERNET_SAUVIGNON',  23);
--insert into wine_product values(278, 11.5, 1, 'UNITED_STATES', 'This Pinot pours a dark ruby in the glass, a nod to the Petaluma Gap intensity of fruit.  Aromas and flavors of ripe melon, fresh flowers, and cinnamon stick mix with a savory elegance of black tea leaves and forest floor.  Finely balanced with fresh acidity and smooth tannins, this is a Pinot packed with flavor!','Adobe Road Sangiacomo Roberts Road Pinot' , 10, 750, 'ADOBE_ROAD_WINERY', 'CENTRAL_COAST', 'RED_WINE', 'CHAMPAGNE',  239);
--insert into wine_product values(279, 13, 40, 'NEW_ZEALAND', 'Aromas of ripe gooseberry overlaid with highlights of golden stone fruit and rockmelon lead to sweet fruit flavours on the palate','Brancott Estate Marlborough Sauvignon Blanc' , 10, 750, 'BRANCOTT_ESTATE', 'CENTRAL_COAST', 'WHITE_WINE', 'SAUVIGNON_BLANC',  16);
--insert into wine_product values(292, 11.5, 40, 'UNITED_STATES', 'The Tepusquet Vineyard Viognier is selected from our 7 acres of the estate planted in 1994. All grapes from our Estate Vineyards are certified under the California Sustainable Winegrowing Alliance and Sustainability in Practice.','Cambria ''Tepusquet Vineyard'' Viognier' , 10, 750, 'CAMBRIA', 'SANTA_BARBARA', 'WHITE_WINE', 'VIOGNIER',  24);
--insert into wine_product values(293, 14.2, 40, 'UNITED_STATES', 'Cambria Julia’s Vineyard Rosé of Pinot Noir is crafted with intention as only two blocks of Pinot Noir from Julia’s Vineyard are farmed specifically for this wine – lively, fresh, expressive. A summer favorite, perfect for brunch or a picnic. All grapes from our Estate Vineyards are certified under the California Sustainable Winegrowing Alliance and Sustainability in Practice.','Cambria Tepusquet Vineyard Syrah' , 10, 750, 'CAMBRIA', 'CALIFORNIA', 'RED_WINE', 'SYRAH_SHIRAZ',  24);
--insert into wine_product values(294,  13.2, 40, 'UNITED_STATES', 'Cambria Julia’s Vineyard Rosé of Pinot Noir is crafted with intention as only two blocks of Pinot Noir from Julia’s Vineyard are farmed specifically for this wine – lively, fresh, expressive. A summer favorite, perfect for brunch or a picnic. All grapes from our Estate Vineyards are certified under the California Sustainable Winegrowing Alliance and Sustainability in Practice.','Cambria ''Julia''s Vineyard'' Rosé of Pinot Noir' , 10, 750, 'CAMBRIA', 'SANTA_BARBARA', 'ROSE_WINE', 'VIOGNIER',  24);
--insert into wine_product values(295,  12.2, 40, 'UNITED_STATES', 'Cambria Estate is a family-owned winery, led by sisters and Proprietors Katie and Julia Jackson. Located in the coastal Santa Maria Valley in Santa Barbara County, Cambria wines faithfully express the unique stamp of one of the finest cool-climate crus in California. Katherine’s Vineyard, named for Katie Jackson in 1986, consists of ancient soils with fossilized seashells, shale, limestone and sand, with fog swept vines that have endured since the 1970s.','The Cambria Collection Pinot Noir, Chardonnay, Syrah' , 10, 750, 'CAMBRIA', 'CALIFORNIA', 'WHITE_WINE', 'PINOT_NOIR',  24);
--insert into wine_product values(296,  11.2, 40, 'UNITED_STATES', 'Cambria Julia’s Vineyard Pinot Noir displays coastal, single vineyard elegance with an authentic sense of place – classic, refined, with a twist. Pinot Noir is one of the most celebrated red wines in Santa Barbara County, California. All grapes from the Cambria Estate Vineyards are certified under the California Sustainable Winegrowing Alliance and Sustainability in Practice.','Cambria Julia''s Vineyard Pinot Noir' , 10, 750, 'CAMBRIA', 'SANTA_BARBARA', 'WHITE_WINE', 'PINOT_GRIGIO_GRIS',  24);
--insert into wine_product values(297,  10.2, 40, 'UNITED_STATES', 'Cambria Katherine’s Vineyard Chardonnay is an ocean influenced, single vineyard expression of “refrigerated sunshine” in a glass – layered, elegant, distinct. Chardonnay is one of the most celebrated white wines in Santa Barbara County, California. All grapes from the Cambria Estate Vineyards are certified under the California Sustainable Winegrowing Alliance and Sustainability in Practice.','Cambria Katherine''s Vineyard Chardonnay' , 10, 750, 'CAMBRIA', 'SANTA_BARBARA', 'WHITE_WINE', 'VIOGNIER',  24);
--insert into wine_product values(300, 12.5, 40, 'FRANCE', 'Célange Bijou Blanc marvels with its golden-straw hue and structural complexity. The vines are planted in clay-limestone soil, lending to its characteristic minerality and balanced acidity. Only the first batch of the finest hand harvested Chardonnay grapes make the award-winning cuvée. The Bijou Blanc offers fresh citrus notes and Acacia flower aromas, making it the perfect partner to fresh seafood and poultry.','Celange Crémant Bijou Blanc Brut' , 10, 750, 'CELANGE', 'MONTEREY_COUNTRY', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  39);
--insert into wine_product values(301, 11.5, 40, 'FRANCE', 'In preserving classic, French winemaking traditions, the grapes are hand picked and gently pressed at the peak of ripeness. Only the first press of the selection is used to ensure the highest quality base wine, which is then vinified in the strictest méthode champenoise.Dry and delicate, with crisp acidity and a creamy palete, this wine pairs perfectly with summer fare and fruit-based deserts. As an accompaniment to fine food or as a symbol of celebration, CÉLANGE Rosé Luxe is for those who truly gift the greatest.','Célange Rosé Luxe' , 10, 750, 'CELANGE', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  64);
--insert into wine_product values(305, 11.5, 40, 'FRANCE', 'Founded in 1760, Champagne Lanson is over 260 years old. Family-owned, guaranteeing the lasting values of the brand. A Champagne located in the heart of Reims with a unique secret garden, Le Clos Lanson, facing the Cathedral. ','Lanson Le Green Label Organic' , 10, 750, 'CHAMPAGNE_LASNSON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  78);
--insert into wine_product values(306, 11.5, 40, 'FRANCE', 'Founded in 1760, Champagne Lanson is over 260 years old. Family-owned, guaranteeing the lasting values of the brand. A Champagne located in the heart of Reims with a unique secret garden, Le Clos Lanson, facing the Cathedral. ','Lanson Brut Rose' , 10, 750, 'CHAMPAGNE_LASNSON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  23);
--insert into wine_product values(307, 11.5, 40, 'FRANCE', 'Founded in 1760 , Champagne Lanson is over 260 years old. Family-owned, guaranteeing the lasting values of the brand. Le Black Label, launched in 1937, owes its emblematic name to Victor Lanson. A Champagne located in the heart of Reims with a unique secret garden, Le Clos Lanson, facing the Cathedral. The authentic style of Le Black Label Brut comes from the House know-how, based on a selection of the finest Crus of Champagne, including historical villas such as Dizy, Verzenay, and Trepail. The original Champagne vinification method of low malolactic fermentation lend to Lanson Brut''s incomparable fruitiness and freshness. A palette of reserve wines spanning numerous vintages over 20 years and longer aging time in cellar give toasty hints of honey and a bouquet of ripe fruits that are light and fresh.','Lanson Le Black Label Brut' , 10, 750, 'CHAMPAGNE_LASNSON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  23);
--insert into wine_product values(316, 11.5, 2, 'ITALY', 'Stellina di Notte Prosecco 2011 is a fun, affordable sparkling wine with delicate aromas of citrus, pear, melon, lemon and almonds. Elegant bubbles enliven the flavors, making them dance on the palate. The body is light, with a lovely balance between crisp acidity and a touch of sweetness. The hint of minerals in the finish is a classic quality of the Prosecco grape, which has been grown in the Tre Venezie region of Northern Italy since Roman times.','Stellina Di Notte Prosecco' , 10, 750, 'CHANDON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  23);
--insert into wine_product values(317, 16.5, 2, 'ITALY', 'In keeping with the style established when the winery was founded, Sweet Star draws on our French heritage and the innovative spirit of California. Like all Chandon wines, Sweet Star is a sophisticated and vibrant sparkling wine that enlivens all occasions.','Chandon California Sweet Star' , 10, 750, 'CHANDON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  23);
--insert into wine_product values(318, 15.5, 3, 'ITALY', 'As the signature style of Chandon, Brut showcases the fruitiness, vibrancy, and freshness of Northern California’s warm, sunny days and cool nights. Grapes for Brut are sourced from multiple cool-climate appellations, ensuring complexity and consistency in this lively, juicy style. A minimum of 12 months aging imparts a creamy complexity balanced by an elegant mouthfeel. Chandon Brut is a refreshing aperitif, or an ideal match with salty or creamy dishes.','Chandon Brut' , 10, 750, 'CHANDON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  64);
--insert into wine_product values(319, 13.5, 1, 'ITALY', 'Crafted in the traditional method, Chandon By the Bay is composed of our purest chardonnays from Carneros; 15% of the wines selected for this blend have been fermented in aged French oak barrels to bring a delicate and subtle layer of complexity to the nose and palate. After second fermentation, these bottles spend three and a half years sur lie in Chandon’s cellars; this is necessary time for this particular cuvee to express its elegance and reach its optimum balance.','Chandon By the Bay' , 10, 750, 'CHANDON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  24);
--insert into wine_product values(320, 2.5, 1, 'ITALY', 'Chandon Blanc de Pinot Noir is characteristically a delicate salmon color driven by Pinot Noir. Dark cherry, currant and strawberry dominate both aroma and flavor with hints of cassis and blackberry.','Chandon Blanc De Pinot Noir' , 10, 750, 'CHANDON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  45);
--insert into wine_product values(321, 13.5, 1, 'ITALY', 'Ready-to-chill and ready-to-share, Garden Spritz is the blend of an exceptional sparkling wine and a unique bitters recipe crafted with handpicked fresh oranges macerated with dry orange peels, herbs and spices carefully selected from the finest terroirs in the world. Enjoy our Garden Spritz.','Chandon Garden Spritz' , 10, 750, 'CHANDON', 'CALIFORNIA', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  62);
--insert into wine_product values(322, 14.5, 1, 'ITALY', 'Vivacious and juicy, Chandon Brut Rosé is a bright, dry rosé with a refreshing lightness - perfect for sipping all year long.','Chandon Brut Rosé' , 10, 750, 'CHANDON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  10);
--insert into wine_product values(323, 11.5, 1, 'ITALY', 'This wine is elegant and restrained with fresh aromas of plum, raspberry and nutmeg. These aromas follow through on the palate and are layered with subtle and delicate flavors of cocoa powder. The wine finishes with excellent length and richness that will stand up to a variety of foods.','Chandon Etoile Rosé' , 10, 750, 'CHANDON', 'SONOMA_COUNTRY', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  20);
--insert into wine_product values(324, 11.5, 1, 'ITALY', 'Tiny bubbles elevate an attractive bouquet of ginger and brown spice. Appealing baked apple, honey and cinnamon flavors meld seamlessly with nutty caramel flavors gained from extended sur lees aging.','Chandon Etoile Brut' , 10, 750, 'CHANDON', 'CALIFORNIA', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  91);
--insert into wine_product values(327, 6.5, 1, 'UNITED_STATES', 'California White Wine with natural flavors and carbonated water in a stylish go-anywhere can. Enjoy straight from the can or use as a mixer in your favorite cocktail recipes.','Cool Cat Berry Wine Spritzer' , 10, 350, 'COOL_CAT', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'SPARKLING_WINE',  12);
--insert into wine_product values(328, 6.5, 1, 'UNITED_STATES', 'California White Wine with natural flavors and carbonated water in a stylish go-anywhere can. Enjoy straight from the can or use as a mixer in your favorite cocktail recipes.','Cool Cat Grapefruit Wine Spritzer' , 10, 350, 'COOL_CAT', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'SPARKLING_WINE',  12);
--insert into wine_product values(329, 6.5, 1, 'UNITED_STATES', 'California White Wine with natural flavors and carbonated water in a stylish go-anywhere can. Enjoy straight from the can or use as a mixer in your favorite cocktail recipes.','Cool Cat Citrus Wine Spritzer' , 10, 350, 'COOL_CAT', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'SPARKLING_WINE',  12);
--insert into wine_product values(330, 11.5, 1, 'FRANCE', 'Cote des Roses Rose Wine celebrates the Mediterranean way of life. The dry wine features a fresh, full palate, great aromatic persistence and balance, and a finish with notes of candy. The French wine reveals aromas of summer fruits, cassis and redcurrant along with floral notes of rose and hints of grapefruit. Enjoy this dry Rose wine chilled as an aperitif, with shellfish or alongside subtly spiced dishes. Each Cote des Roses bottle of wine boasts a unique rose shape created by a young designer from the Ecole Boulle.','Cote des Roses Rosé' , 10, 750, 'COTE_DES_ROSES', 'CENTRAL_COAST', 'ROSE_WINE', 'ROSE',  23);
--insert into wine_product values(343, 11.5, 15, 'FRANCE', 'Dom Pérignon, elevated to its second life. After about 15 years of slow transformation in the cellars, Dom Pérignon expands its energy and is elevated to new heights. The result is deeper, more intense, sharper, higher, and gifted further with a new longevity.','Dom Pérignon P2 2003' , 10, 750, 'DOM_PERIGNON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  400);
--insert into wine_product values(344, 11.5, 10, 'FRANCE', 'Dom Pérignon’s creative ambition is a perpetual quest for harmony as a source of emotion. Every creative process faces constraints. For Dom Pérignon, this means always a vintage wine. An unyielding commitment to bear witness to the harvest of a single year, whatever the challenges, even going as far as not declaring a vintage.','Dom Pérignon Vintage 2013 Giftbox' , 10, 750, 'DOM_PERIGNON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  300);
--insert into wine_product values(345, 11.5, 20, 'FRANCE', 'Dom Pérignon is pleased to unveil Dom Pérignon P2 2002, the second expression of this vintage. Presence and relevance reveal a wine of 17 years of maturation. First launched in 2008, the vintage here acquires a new expression in its Second Plenitude, marked by extra energy, intensity, vitality and depth. ','Dom Pérignon P2 2002' , 10, 750, 'DOM_PERIGNON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  384);
--insert into wine_product values(346, 11.5, 23, 'FRANCE', 'Dom Pérignon Vintage 2010 was a bold wager, one that has been won thanks to considerable courage. It is the fruit of an unwavering commitment to expressing nature, experience and expertise while according the freedom needed for audacious endeavors.','Dom Pérignon 2010' , 10, 750, 'DOM_PERIGNON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  263);
--insert into wine_product values(347, 11.5, 23, 'FRANCE', 'The year 2000 was warm, with cooler-than-average temperatures in the month of July and frequent storms that brought significant amounts of rain and hail. The initial tastings revealed that the Chardonnay grapes harvested last were supple, ample and complex. The Pinot Noir harvest was structured and offered great length.','Dom Pérignon Rosé Champagne 2000' , 10, 750, 'DOM_PERIGNON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  488);
--insert into wine_product values(348, 11.5, 1, 'FRANCE', 'The full-bodied ease of the 2006 vintage will leave its mark on the history of Dom Pérignon. In stark contrast to the previous year, the vines experienced steady, problem-free vegetative growth, with abundant, sizable grape clusters. ','Dom Pérignon Rosé Vintage 2006' , 10, 750, 'DOM_PERIGNON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  263);
--insert into wine_product values(349, 11.5, 1, 'FRANCE', 'Dom Pérignon’s creative ambition is a perpetual quest for harmony as a source of emotion. Every creative process faces constraints. For Dom Pérignon, this means always a vintage wine. An unyielding commitment to bear witness to the harvest of a single year, whatever the challenges, even going as far as not declaring a vintage','Dom Pérignon Rosé Vintage 2008' , 10, 750, 'DOM_PERIGNON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  272);
--insert into wine_product values(350, 11.5, 1, 'FRANCE', 'Time is part of the Dom Pérignon equation. It takes no fewer than eight years of elaboration to reach the aesthetic ideal of Dom Pérignon. In the darkness of the cellars, inside the bottles, each vintage experiences a slow transformation in contact with yeasts to obtain the harmony that will characterize Dom Pérignon forever. Everything is there, with great precision and impressive equilibrium.','Dom Pérignon Vintage 2013' , 10, 750, 'DOM_PERIGNON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  382);
--insert into wine_product values(351, 11.5, 1, 'FRANCE', 'The bouquet bursts forth with raspberries and wild strawberries. Persistent powdery notes of iris and violet immediately meld with the fruit aromas. After breathing, greener nuances arrive, evoking privet, angelica and camphor tree.','Rosé Vintage ' , 10, 750, 'DOM_PERIGNON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  327);
--insert into wine_product values(352, 11.5, 1, 'FRANCE', 'The bouquet is mesmerizing, ripe, and complex. The opening notes are a blend of dark spices and cocoa which develop very quickly into fruit aromas. Fruit reigns supreme, with roasted fig and apricot and candied orange. The overall effect exudes smoky accents. On the palate, the fullness of the wine is immediately striking. Its intensity and succulence set the tone through the sweetness and crisp punch of the flavors. The silky mouthfeel melts into a smooth, tight, and grainy structure with just a hint of vegetable flavors. The wine expresses an appealing brininess and saline character.','Dom Pérignon Rosé Vintage 2008: Lady Gaga Limited Edition' , 10, 750, 'DOM_PERIGNON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  283);
--insert into wine_product values(353, 11.5, 1, 'FRANCE', 'When Dom Pérignon chooses to be Rosé, it is a declaration of freedom. Freedom to cast convention aside and push its own boundaries, seizing the red of the pinot noir grape in its primal radiance, capturing its vital power in a bold, assertive assemblage. Tempered by a slow, masterful transformation during nearly 12 years of elaboration, Dom Pérignon Rosé is untamed and carnal, both light and dark, electrifying.','Dom Pérignon Rosé 2006 Lady Gaga Limited Edition' , 10, 750, 'DOM_PERIGNON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  333);
--insert into wine_product values(354, 11.5, 1, 'FRANCE', 'The collaboration between Dom Pérignon and Lady Gaga marks the encounter of two creative forces. Lady Gaga, inspiring us to dream, to experiment, to express ourselves. And Dom Pérignon, perpetually exploring the edge of creation. Today, uniting their energies to spark inspiration. The design of this limited edition, rippling and shifting, is itself a visual ode to creativity. A vital impulse. A celebration of those who push boundaries.','Dom Pérignon Vintage 2010 Lady Gaga Limited Edition' , 10, 750, 'DOM_PERIGNON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  983);
--insert into wine_product values(355, 8.5, 1, 'GERMANY', 'This wine is made exclusively from the famed Bockstein vineyard which is a VDP Grosse Lage®. VDP. Grosse Lage® is the designation for the very best German vineyards (equivalent of the Burgundian “Grand Cru”). The sites are precisely demarcated vineyard parcels. It is here that the best wines ripen, wines that express a unique vineyard origin and possess exceptional aging potential.','Dr Fischer Ockfener Bockstein Riesling Spatlese' , 10, 750, 'DR_FISCHER', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHARDONNAY',  34);
--insert into wine_product values(375, 11.5, 1, 'FRANCE', 'Moët & Chandon Grand Vintage 2013 is a champagne marked by a late harvest. It encapsulates a year of waiting, a year of anticipation. The season shines through in its flavours and aromas, while its maturity is expressed through its autumnal notes, golden hue and persistent bubbles. ','Moët & Chandon Grand Vintage Blanc 2013' , 10, 750, 'MOET_CHANDON', 'CENTRAL_COAST', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  139);
--insert into wine_product values(376, 11.5, 1, 'FRANCE', 'The vibrant and generous Moët & Chandon Impérial Champagne makes every holiday a celebration and is perfect for every occasion. This specific packaging allows for more message customization than the traditional Impérial bottle – no need for a card when you have this bottle!','Moët Imperial Brut Metal Milestones Giftbox "You Are Going Places"' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  193);
--insert into wine_product values(377, 11.5, 1, 'FRANCE', 'Nectar Impérial Rosé is a lush and voluptuous expression of the Moët & Chandon style, a style distinguished by its extravagant fruitiness, its density on the palate and its crisp finish that instantly surprises and delights. The Nectar Impérial Rosé assemblage is built on the intensity of Pinot Noir, the fruitiness of Pinot Meunier, and the freshness of Chardonnay. On the palate, richness and freshness balance together, with the persistent intensity of ripe berries warmed by sensual nutmeg and caramel, finishing with a fresh hit of red currant.','NBA Collection by Just Don Limited Edition Bottle' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  163);
--insert into wine_product values(378, 11.5, 1, 'FRANCE', 'Moët & Chandon has been the Champagne of success and glamour since 1743. Renowned for its achievements and legendary pioneering spirit, Moët & Chandon is synonymous with both cherished traditions and modern pleasures; it has helped celebrate life’s most triumphant moments for close to 280 years. In 1842, Moët & Chandon created one of the first vintage Champagnes for British and American connoisseurs, who appreciated more mature wines. With the distinctive expression of a single year’s grapes, each new vintage contributes to the House’s legendary heritage of crafting the finest Champagnes: the Grand Vintage Collection.','Vintage Blanc 2015' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  183);
--insert into wine_product values(379, 11.5, 1, 'FRANCE', 'Give the gift of Moët & Chandon Rosé Impérial, which signifies a spontaneous, radiant, romantic expression of the Moët & Chandon style. This specific packaging allows for more message customization than the traditional Rosé Impérial bottle – no need for a card when you have this bottle!','Moët Imperial Rosé Metal Milestones Giftbox "To Your Next Milestone"' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  156);
--insert into wine_product values(380, 11.5, 1, 'FRANCE', 'The vibrant and generous Moët & Chandon Impérial Champagne makes every holiday a celebration and is perfect for every occasion. This specific packaging allows for more message customization than the traditional Impérial bottle – no need for a card when you have this bottle!','Moët Imperial Brut Metal Milestones Giftbox "Happy Birthday to You"' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  103);
--insert into wine_product values(381, 11.5, 1, 'FRANCE', 'Moët Impérial is the House’s iconic champagne. Created in 1869, it embodies the unique Moët & Chandon style. A style that distinguishes itself by its bright fruitiness, its seductive palate and its elegant maturity.','Moët Imperial Brut Metal Milestones Giftbox "To Your Future"' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  193);
--insert into wine_product values(382, 11.5, 1, 'FRANCE', 'Limited Edition Moët Impérial bottle (75cl) to bring the 150th anniversary to life. Anniversary design made of golden glass decoration. Anniversary mention on the tie and specific back label narrating the Impérial saga.','Moët & Chandon Impérial Brut 150th Anniversary Bottle' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  193);
--insert into wine_product values(383, 11.5, 1, 'FRANCE', 'Moët & Chandon has been the Champagne of success and glamour since 1743. Renowned for its achievements and legendary pioneering spirit, Moët & Chandon is synonymous with both cherished traditions and modern pleasures; it has helped celebrate life’s most triumphant moments for close to 280 years. In 1842, Moët & Chandon created one of the first vintage Champagnes for British and American connoisseurs, who appreciated more mature wines. With the distinctive expression of a single year’s grapes, each new vintage contributes to the House’s legendary heritage of crafting the finest Champagnes: the Grand Vintage Collection.','Moët & Chandon Grand Vintage Rosé 2015' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  183);
--insert into wine_product values(384, 11.5, 1, 'FRANCE', 'it embodies the unique Moët & Chandon style. A style that distinguishes itself by its bright fruitiness, its seductive palate and its elegant maturity.','Moët & Chandon Imperial X NBA Collection by Just Don Limited Edition Bottle' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  173);
--insert into wine_product values(385, 11.5, 1, 'FRANCE', 'Moët Ice Impérial Rosé has a gleaming, vivid pink color with golden highlights. Its vibrant, fruity bouquet has scents mainly of fragrant red berries and cherries (Morello cherry, lingonberry, cranberry), with nuances of juicy summer fruits (fig, nectarine) and an appetizing note of grenadine. Its luscious palate combines sweetness and firmness: the sweetness reminiscent of berries disperses and becomes lighter, there is a harmonious balance of freshness and fruitiness, and a refreshing finish with a deliciously bittersweet note of pink grapefruit.','Moët & Chandon Ice Impérial Rosé' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  173);
--insert into wine_product values(386, 11.5, 1, 'FRANCE', 'Faithful to the tradition of innovation, Moët & Chandon has revolutionized the world of Champagne with a breakthrough creation, Moët Ice Impérial, the first champagne created to be served on ice cubes. Breaking all the traditional Champagne rules, Moët Ice Impérial, brings freshness and modernity to the next generation of luxury. ','Moët & Chandon Ice Impérial' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  163);
--insert into wine_product values(387, 11.5, 1, 'FRANCE', 'Nectar Impérial is the boldest and most unexpected Moët & Chandon champagne. It reflects the diversity and complementarities of the three champagne grapes and the richness of the region''s best vineyards to reveal the magic of the world''s most loved champagne. Creamy and vibrant, Nectar Impérial distinguishes itself by the richness of tropical fruits (pineapple and mango), rounded out by the silkiness of fresh plum and apricot, and finishing with bracing grapefruit notes.','Moët & Chandon Nectar Impérial' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  183);
--insert into wine_product values(388, 11.5, 1, 'FRANCE', 'Nectar Impérial Rosé is a lush and voluptuous expression of the Moët & Chandon style, a style distinguished by its extravagant fruitiness, its density on the palate and its crisp finish that instantly surprises and delights. The Nectar Impérial Rosé assemblage is built on the intensity of Pinot Noir, the fruitiness of Pinot Meunier, and the freshness of Chardonnay. On the palate, richness and freshness balance together, with the persistent intensity of ripe berries warmed by sensual nutmeg and caramel, finishing with a fresh hit of red currant.','Moët & Chandon Nectar Impérial Rosé' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  103);
--insert into wine_product values(389, 11.5, 1, 'FRANCE', 'The vibrant and generous Moët & Chandon Impérial Champagne makes every holiday a celebration and is perfect for New Year’s Eve, Christmas, Thanksgiving, Mother’s Day, Father''s Day, or Valentine’s Day. This gift elevates any occasion and says “Congratulations” for an Anniversary, Wedding, Bridal Shower, Bachelor Party, College Graduation, Birthday, Housewarming, Retirement, New Job, Job Promotion, Family Reunion, or the close of a Business Deal.','Imperial Brut' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  103);
--insert into wine_product values(390, 11.5, 1, 'FRANCE', 'The vibrant and generous Moët & Chandon Impérial Champagne makes every holiday a celebration and is perfect for New Year’s Eve, Christmas, Thanksgiving, Mother’s Day, Father''s Day, or Valentine’s Day. This gift elevates any occasion and says “Congratulations” for an Anniversary, Wedding, Bridal Shower, Bachelor Party, College Graduation, Birthday, Housewarming, Retirement, New Job, Job Promotion, Family Reunion, or the close of a Business Deal.','Impérial Signature Bottle' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  102);
--insert into wine_product values(391, 11.5, 1, 'FRANCE', 'One of today’s most celebrated creatives, Virgil Abloh has debuted an exclusive collection of custom-designed bottles of Moët & Chandon’s Nectar Imperial Rosé, marking the designer’s first-ever wine & spirits brand collaboration. ','Impérial Rosé by Virgil Abloh' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  134);
--insert into wine_product values(392, 11.5, 1, 'FRANCE', 'Moët & Chandon introduces its newest Limited Edition collaboration with rising creative talent Yoon Ahn, co-founder and Creative Director of the fashion label AMBUSH. Nectar Impérial Rosé is the most gourmet and voluptuous expression of the Moët & Chandon styles, distinguished by its extravagant fruitiness, its density on the palate, and crisp finish.','Impérial Rosé Limited Edition x Yoon Ahn' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  59);
--insert into wine_product values(393, 11.5, 1, 'FRANCE', 'This holiday season, gift something unique & personalized to your loved ones to make it meaningful.  The new Specially Yours metal gift boxes showcase 5 special messages for various gifting occasions: Congratulations, Happy Holidays, Cheers, Thank You, and Happy Birthday.  This elegant gifting offer also keeps your bottle chilled for up to 2 hours thanks to a metallic exterior and an insulating interior.','Brut with "Congratulations" Gift Box' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  46);
--insert into wine_product values(394, 11.5, 1, 'FRANCE', 'Moët Impérial is the House’s iconic champagne. Created in 1869, it embodies the unique Moët & Chandon style. A style that distinguishes itself by its bright fruitiness, its seductive palate and its elegant maturity.','Nectar Impérial' , 10, 750, 'MOET_CHANDON', 'CHAMPAGNE', 'CHAMPAGNE_SPARKLING_WINE', 'CHAMPAGNE',  60);

