--insert into rum_product values(405, 40, 4, 'JAMAICA', 'Inspired by the vibrancy of Jamaica, its land and the joyful nature of its people, Appleton Estate has been crafting rum for over 265 years. Crafted with Jamaican limestone-filtered water and no added flavors, Appleton Estate Signature Blend is a delicious blend of pot and column still rums, aged for an average of 4 years.','Signature Blend Jamaica Rum' , 10, 750, 'APPLETON_ESTATE', 'FLORIDA', 'DARK_RUM',  76);
--insert into rum_product values(406, 43, 15, 'JAMAICA', 'Appleton Estate can be found deep in the heart of Jamaica’s lush Nassau Valley, with a distinct landscape that is wholly unique and especially ideal for rum-making. The combination of the climate, soil and topography of Appleton Estate make it one of the few rums in the world to claim “terroir” as a point of difference.','Appleton Estate 15 Year Old Rum' , 10, 750, 'APPLETON_ESTATE', 'PUERTO_RICO', 'AGED_RUM', 46);
--insert into rum_product values(407, 40, 12, 'JAMAICA', 'A true expression of our Master Blender Joy Spence’s passion and craft. The rums that make up this blend of rare and hand-selected pot and column still rums are crafted with Jamaican limestone-filtered water, with no added flavors, and have all been aged for a minimum of 12 years in the tropical climate of Jamaica.','Rare Casks Rum' , 10, 750, 'APPLETON_ESTATE', 'PUERTO_RICO', 'AGED_RUM',  30);
--insert into rum_product values(408, 30, 25, 'JAMAICA', 'Crafted by Master Blender Joy Spence to commemorate our 250th anniversary. This blend of pot and column still rums, aged a minimum of 8 years in the tropical climate of Jamaica, is made with Jamaican limestone-filtered water and no added flavors.','Reserve Casks Rum' , 10, 750, 'APPLETON_ESTATE', 'PUERTO_RICO', 'DARK_RUM',  32);
--insert into rum_product values(409, 43, 25, 'JAMAICA', 'Appleton Estate Joy Anniversary Blend is a beautifully complex and elegant, rare rum celebrating Joy Spence’s 20th anniversary as Master Blender. In 1997 Joy made history, ascending to the helm of Appleton Estate to become the spirit industry’s first female Master Blender. At once an artist and a scientist, Joy has created some of the world’s finest aged rums. This exquisite limited edition is the culmination of Joy’s pioneering spirit, inventive mind, and dedication to her craft. This 25-year-old minimum aged rum includes rum aged up to 35 years, and is a reflection of the woman who created it - an embodiment of passion, love, and, above all else, joy.','Joy Anniversary Blend' , 10, 750, 'APPLETON_ESTATE', 'PUERTO_RICO', 'DARK_RUM',  23);
--insert into rum_product values(422, 40, 3, 'PUERTO_RICO', 'BACARDÍ Gran Reserva Maestro de Ron is named after the Maestros de Ron (Master Blenders) that have safeguarded the secrets of the family’s rum-making process for over 150 years. Gran Reserva Maestro de Ron is double-aged in white oak casks for a warm and smooth liquid with notes of pear, red currant, honey and walnut. ','Gran Reserva Maestro' , 10, 750, 'BACARDI', 'PUERTO_RICO', 'ORIGINAL_RUM', 183);
--insert into rum_product values(423, 40, 8, 'UNITED_STATES', 'Reserva Ocho Rum is one of the oldest private rum blends in the world that you can casually sip for an elevated drinking experience. This gluten free golden rum is barrel-aged for no less than 8 years under the Caribbean sun and filtered through charcoal, resulting in uncompromising quality. Offering a smooth taste, this complex BACARDI rum features a deep, layered and mellow flavor of dried fruits, spices and oaky vanilla.','Reserva Ocho' , 10, 750, 'BACARDI', 'PUERTO_RICO', 'AGED_RUM', 138);
--insert into rum_product values(424, 40, 10, 'PUERTO_RICO', 'BACARDI Gran Reserva Diez Rum is an expertly blended rum that creates a uniquely elevated drinking experience. This gluten free golden rum is barrel-aged for no less than 10 years under the Caribbean sun and filtered through charcoal, resulting in uncompromising quality. Offering a smooth taste, this BACARDI rum features bright notes of stone fruits, banana and pear balanced with caramelized vanilla and oak.','Gran Reserva Diez Rum' , 10, 750, 'BACARDI', 'PUERTO_RICO', 'AGED_RUM', 173);
--insert into rum_product values(425, 40, 1, 'UNITED_STATES', 'BACARDI Superior is the perfect white rum that you can casually sip or mix into any number of cocktails to liven up the party. This BACARDI white rum liquor is aged in American white oak barrels and shaped through a secret blend of charcoal for a distinctive smoothness that makes it easy to have fun. This superior BACARDI Rum alcohol is a light and aromatically balanced aged rum that is 80 proof and offers an aroma of almonds and fruit with a smooth and creamy flavor and a dry, clean, fresh finish.','Superior' , 10, 750, 'BACARDI', 'PUERTO_RICO', 'WHITE_RUM', 142);
--insert into rum_product values(426, 40, 8, 'PUERTO_RICO', 'A limited-edition rare rum blend crafted by BACARDÍ Rum’s Master Blenders, BACARDÍ Reserva Ocho Sherry Cask Finish is aged in some of the most exceptional hand selected barrels from the Bacardí family reserve. Our Sherry Cask finish is a blend aged from 8 to 12 years in American oak barrels with an additional finish of three months in Oloroso sherry cask.','Reserva Ocho Sherry Cask Finish (limited edition)' , 10, 750, 'BACARDI', 'PUERTO_RICO', 'AGED_RUM', 143);
--insert into rum_product values(427, 40, 2, 'UNITED_STATES', 'BACARDI Gold Rum is the perfect aged rum that you can casually sip or mix into any number of cocktails. This light-bodied rum is filtered through a secret blend of charcoal, mellowed for one to two years in toasted American white oak barrels, and blended to create a light golden rum with a soft oak flavor. This gluten free BACARDI Rum imparts notes of vanilla, ginger root and toasted with a dry and slightly sweet finish.','Bacardí Gold' , 10, 750, 'BACARDI', 'PUERTO_RICO', 'SPICED_FLAVORED', 162);
--insert into rum_product values(428, 40, 17, 'UNITED_STATES', 'BACARDI Gran Reserva Limitada Rum is the rarest and most luxurious expression of BACARDI. It''s perfect to casually sip for an elevated drinking experience. This gluten free rum is crafted by selecting the most exceptional barrel aged rums from the BACARDI family’s extensive reserves and balancing them with younger aged rums to produce a perfectly balanced yet richly flavored spirit.','Gran Reserva Limitada' , 10, 750, 'BACARDI', 'PUERTO_RICO', 'AGED_RUM', 124);
--insert into rum_product values(429, 40, 1, 'PUERTO_RICO', 'A limited-edition rare rum blend, crafted by BACARDÍ Rum’s Master Blenders, who have hand selected some of the most exceptional barrels of aged rum from the Bacardí family reserve. BACARDÍ Reserva Ocho Años Rum, Rye cask finish is a blend aged from 8 to 12 years in American oak barrel with a additional finish in Kentucky rye casks. Taste is sweet, smooth velvety texture with notes of distinct smokiness, white pepper, subtle vanilla, and caramelize brown sugar​. Aroma features notes of gingerbread, maple sugar sweetness, and a hint of spiciness​.','Reserva Ocho Rye Cask Finish' , 10, 750, 'BACARDI', 'PUERTO_RICO', 'AGED_RUM', 234);
--insert into rum_product values(430, 35, 2, 'PUERTO_RICO', 'BACARDI Spiced Rum is the perfect aged rum that you can casually sip or mix into any number of cocktails. This balanced BACARDI dark rum is charred in American oak barrels to retain its distinct taste, color, and smokiness. This gluten free BACARDI rum has both light and deep notes with sweet and spiced flavors and a black pepper finish.','Bacardí Spiced Rum' , 10, 750, 'BACARDI', 'PUERTO_RICO', 'AGED_RUM', 123);
--insert into rum_product values(431, 40, 3, 'PUERTO_RICO', 'BACARDI Black Rum is the perfect aged rum that you can casually sip or mix into any number of cocktails. This medium-bodied BACARDI dark rum is mellowed in heavily charred oak barrels, lightly filtered, and shaped through a secret blend of charcoals to retain its distinct taste, color, and aroma. This gluten free BACARDI Rum imparts toasted nutty aromatic notes with tropical fruit and molasses flavors and a smoky finish.','Bacardí Black' , 10, 750, 'BACARDI', 'PUERTO_RICO', 'AGED_RUM', 152);
--insert into rum_product values(432, 40, 1, 'PUERTO_RICO', 'BACARDI Limon Rum gets its name from the Spanish word for lemon, and offers the perfect blend of white rum and citrus fruits to transport you to a tropical paradise. Expertly blended for an intense flavor to create refreshing cocktails, this Limon Rum uses BACARDI white rum to create a light base with a natural flavor and purified water for a delicious tropical drink. This gluten free BACARDI rum delivers fresh, crisp citrus aromas and a robust, full citrus taste for a flavored rum specialty that tastes like sunshine.','Bacardí Limon' , 10, 750, 'BACARDI', 'PUERTO_RICO', 'SPICED_FLAVORED', 193);
--insert into rum_product values(433, 40, 1, 'PUERTO_RICO', 'BACARDÍ Reserva Ocho rum boasts warming notes of butterscotch, nutmeg and dried apricots. Longer aging brings out additional complexity of flavors from the barrel and develops a rich body with velvety smoothness.','Reserva Ocho Gift Pack' , 10, 750, 'BACARDI', 'PUERTO_RICO', 'AGED_RUM', 40);
--insert into rum_product values(434, 40, 1, 'PUERTO_RICO', 'BACARDI Anejo Cuatro is inspired by Don Facundo''s original Anejo recipe and spends a minimum of four years aging under the Caribbean sun to achieve its unique taste and soft golden color. Matured in American white oak barrels, this gluten free BACARDI rum is filtered through charcoal for a smooth finish and expertly blended for an extraordinary character. This aged rum features notes of mild vanilla, toasted oak, dark honey and clove with a smooth toffee and oak finish.','Añejo Cuatro Rum' , 10, 750, 'BACARDI', 'PUERTO_RICO', 'AGED_RUM', 27);
--insert into rum_product values(450, 35, 40, 'VENEZUELA', 'From the oldest Venezuelan rum brand, Santa Teresa 1796 is one of the first super-premium rums to employ the Solera Method, an artisanal processing method featuring a blend of light, heavy and pot still rums aged 4 to 35 years. Santa Teresa 1796 features a palate that hearkens back to scotch and whisky, with notes of tobacco, molasses and dark chocolate. This holiday season, gift a bottle that encompasses 225 years of master rum-making all while bringing friends and family together.','Solera Rum Gift Box' , 10, 750, 'SANTA_TERESA', 'PUERTO_RICO', 'AGED_RUM', 58);
--insert into rum_product values(451, 35, 40, 'VENEZUELA', 'Santa Teresa Rum 1796 has been making bold choices for over 225 years to create extraordinary results becoming Venezuela’s oldest rum producer of award-winning single estate rums. It’s the world’s first super premium rum made using the artisanal Solera method, resulting in an unexpectedly dry, smooth and balanced rum. This rum is aged up to 35 years in bourbon oak barrels, fermented, distilled, and blended with sugar cane and natural water all on the Hacienda estate. Surprisingly dry, yet smooth and balanced, this amber rum delivers a fruity aroma with notes of wood, and a unique taste of vanilla, cinnamon, dark chocolate, hints of honey and peppery finish.','Solera Rum' , 10, 750, 'SANTA_TERESA', 'PUERTO_RICO', 'AGED_RUM', 65);
--insert into rum_product values(455, 18, 40, 'PANAMA', 'The 30 Year Old Reserva Don Pancho evokes the true orthodox school of Cuban rum, a product not intended for mainstream, but rather connoisseurs. In Don Pancho’s own words; “this is not an aperitif but a digestif, drink it slowly, drink it neat. Never alone.” ','Origenes 18 Year Old Rum' , 10, 750, 'DON_PANCHO', 'PUERTO_RICO', 'AGED_RUM', 40);
--insert into rum_product values(456, 30, 40, 'PANAMA', 'Don Pancho began his career in Cuba in the early 60’s, after receiving a degree in microbiology, he decided to pursue his passion for creating great rums. Crafted in the classic “Cuban style,” Don Pancho Origenes rums are made with molasses from hand-harvested sugar cane and a proprietary yeast, are distilled in a copper column still and then aged in American oak bourbon barrels.','Origenes 30 Year Old Rum' , 10, 750, 'DON_PANCHO', 'PUERTO_RICO', 'AGED_RUM', 40);
--insert into rum_product values(457, 8, 40, 'PANAMA', 'Don Pancho created this 8 Year Old rum in order to recreate the rum he used to drink when he was young in Cuba, at a time where 7YO and 8YO rums where the oldest rums available.  A versatile product meant to drink neat, on the rocks, or in a fine cocktail.','Origenes 8 Year Old' , 10, 750, 'DON_PANCHO', 'PUERTO_RICO', 'AGED_RUM', 40);
--insert into rum_product values(459, 2, 40, 'TRINIDAD_AND_TOBAGO', 'This is Stolen Smoked Rum. This rum is inspired by wanderlust, one of our favorite lusts.It’s the world’s first smoked rum. It’s made in Trinidad from locally sourced sugar cane. It’s column-distilled and aged for at least two years in ex-whiskey barrels made from American oak. Additional flavor is imbrued into the rum using 100% Arabica coffee beans from Columbia, fenugreek seeds from Morocco, and vanilla beans from Madagascar.','Stolen Smoked Rum' , 10, 750, 'STOLEN', 'PUERTO_RICO', 'SPICED_FLAVORED', 40);
--insert into rum_product values(435, 29, 1, 'UNITED_STATES', 'Colina Colada is the original, all-natural  Caribbean rum horchata liqueur. Our skillful artisans use our authentic, centruries old cuban recipe, handcrafting the finest Caribbean rum with our premium, wonderfully light and fresh almond dairy cream and pair it with fresh cinnamon, lemon, and other unique and tantalizing spices that capture the true essence of the Caribbean for all to enjoy! ','Colina Colada Caribbean Rum Horchata' , 10, 750, 'COLINA_COLADA', 'FLORIDA', 'ORIGINAL_RUM', 23);
--insert into rum_product values(441, 40, 15, 'DOMINICAN_REPUBLIC', 'Two brothers, Benjamin and Edward Camp, and their third partner, Evaristo Alvarez, embarked on an adventure to create the highest quality, smoothest rum. Thus, Matusalem® Rum was born, becoming Cuba’s national rum during the Golden Age (mid-1930s-early 1950s). This era abruptly ended with the coming of the Castro revolution. 140 years later, the name continues to be recognized globally as a symbol of quality. A carefully guarded secret formula that has been passed down through generations, Matusalem® is the first rum – and one of the very few today – to use the Solera blending and aging process. This Solera method is based on techniques used for sherry, brandy, and cognac, and utilizes a unique combination of aged rums, whose average age is reflected in the Solera number.','Matusalem® Gran Reserva 15' , 10, 750, 'MATUSALEM', 'FLORIDA', 'AGED_RUM', 40);
--insert into rum_product values(442, 29, 18, 'DOMINICAN_REPUBLIC', 'Matusalem® makes triple-distilled, hand-crafted, blended spirits. During the Solera method, young and older rums are blended many times in French oak barrels. At the end, Matusalem® bottles Gran Reserva, and younger blends. Gran Reserva 15-year, 18-year and 23-year rums are dark, rich, golden. With aromas of sweet vanilla, molasses, caramel and plums, the taste is delicate, velvety smooth with hints of vanilla, molasses and caramel. ','Matusalem® Gran Reserva 18 Year' , 10, 750, 'MATUSALEM', 'FLORIDA', 'ORIGINAL_RUM', 57);
--insert into rum_product values(443, 29, 13, 'DOMINICAN_REPUBLIC', 'Matusalem® makes triple-distilled, hand-crafted, blended spirits. During the Solera method, young and older rums are blended many times in French oak barrels. At the end, Matusalem® bottles Gran Reserva, and younger blends. Gran Reserva 15-year, 18-year and 23-year rums are dark, rich, golden. With aromas of sweet vanilla, molasses, caramel and plums, the taste is delicate, velvety smooth with hints of vanilla, molasses and caramel.','Matusalem® Platino' , 10, 750, 'MATUSALEM', 'FLORIDA', 'ORIGINAL_RUM', 34);
--insert into rum_product values(444, 29, 23, 'DOMINICAN_REPUBLIC', 'Matusalem® makes triple-distilled, hand-crafted, blended spirits. During the Solera method, young and older rums are blended many times in French oak barrels. At the end, Matusalem® bottles Gran Reserva, and younger blends. Gran Reserva 15-year, 18-year and 23-year rums are dark, rich, golden. With aromas of sweet vanilla, molasses, caramel and plums, the taste is delicate, velvety smooth with hints of vanilla, molasses and caramel.','Matusalem® Gran Reserva 23 Year' , 10, 750, 'MATUSALEM', 'FLORIDA', 'ORIGINAL_RUM', 67);
--insert into rum_product values(445, 29, 1, 'DOMINICAN_REPUBLIC', 'Two brothers, Benjamin and Edward Camp, and their third partner, Evaristo Alvarez, embarked on an adventure to create the highest quality, smoothest rum. Thus, Matusalem® Rum was born, becoming Cuba’s national rum during the Golden Age (mid-1930s-early 1950s). This era abruptly ended with the coming of the Castro revolution. 140 years later, the name continues to be recognized globally as a symbol of quality. A carefully guarded secret formula that has been passed down through generations, Matusalem® is the first rum – and one of the very few today – to use the Solera blending and aging process. This Solera method is based on techniques used for sherry, brandy, and cognac, and utilizes a unique combination of aged rums, whose average age is reflected in the Solera number.','Matusalem® Clásico 10' , 10, 750, 'MATUSALEM', 'FLORIDA', 'ORIGINAL_RUM', 23);
--insert into rum_product values(447, 40, 15, 'MEXICO', 'Pyrat XO Reserve Rum is an elegant, distinctive ultra-premium spirit produced by the creators of Patron Tequila. This rum is made by blending carefully chosen Caribbean barrel aged rums, many of which have been aged in oak barrels for up to 15 years for a smooth, rich flavor. The aged rum is 80 proof and offers a burst of aromas that include caramel, honey, molasses and orange peel with a palate that is delicate and smooth, almost sweet, with hints of fresh spices.','PYRAT XO Reserve Rum' , 10, 750, 'PYRAT_XO_RESERVE', 'PUERTO_RICO', 'AGED_RUM', 40);
--insert into rum_product values(462, 24, 43, 'GUATEMALA', 'Zacapa Edición Negra is masterfully crafted in Guatemala using the first press of sugar cane and aged 2300m ''Above the Clouds'' to slow the aging process, developing layers of aromas and flavors within the rum. Zacapa Edición Negra is made of a blend of rums between 6 and 24 years old and is inspired by the natural elements of Guatemala including the dark fire of its volcanoes. Edición Negra is aged in select barrels including double charred American oak casks, creating a rich, dark rum with a smoky intensity. Every bottle of Edición Negra is adorned with a hand-woven petate band crafted by our community of over 700 Guatemalan weavers. Zacapa Edición Negra is best served neat or on the rocks and provides a smoky twist to your dark spirits classic cocktails.','Zacapa Edición Negra' , 10, 750, 'ZACAPA', 'PUERTO_RICO', 'AGED_RUM', 77);
--insert into rum_product values(463, 23, 40, 'GUATEMALA', '','Zacapa 23' , 10, 750, 'ZACAPA', 'PUERTO_RICO', 'AGED_RUM', 73);
--insert into rum_product values(464, 16, 40, 'GUATEMALA', '','Zacapa XO' , 10, 750, 'ZACAPA', 'PUERTO_RICO', 'AGED_RUM', 48);
--insert into rum_product values(469, 30, 40, 'JAMAICA', 'With Xaymaca Special Dry, Plantation revives the quintessential Jamaican-style, 100% pot still rums of the 19th century with an expression of intense flavors that reveal the traditional, legendary ''rum funk'': aromas and flavors of black banana and flame pineapple, locally called ''Hogo.'' Xaymaca Special Dry is a blend of rums distilled in the old John Dore port still at Long Pond Distillery, and the Vendome at Clarendon distillery. The idea is to boldly assert the powerful and expressive character of these rums. ','Plantation Xaymaca Rum' , 10, 750, 'PLANTATION', 'PUERTO_RICO', 'AGED_RUM', 47);
--insert into rum_product values(470, 23, 40, 'BARBADOS', 'A tribute to the character created by Charles Dickens in the Pickwick Papers, Reverend Stiggins, whose favorite drink was ''pineapple rum.'' The barks of Victoria pineapples are infused in Plantation 3 Stars Rum, which is then further distilled. Separately, the pineapple fruit is infused in Plantation Original Dark rum. Both distillate and fruit infusion are finally blended together, creating a rich and delicious pineapple bouquet, accented by smoky and clove notes.','Stiggins Fancy Pineapple Rum' , 10, 750, 'PLANTATION', 'PUERTO_RICO', 'AGED_RUM', 84);
--insert into rum_product values(471, 24, 40, 'BARBADOS', 'The rich and intense style of Jamaica and Barbados, with their notes plum, banana, and vanilla, is enhanced by meticulous blending and further maturation, in France. The result is a profound structure spiced with notes of cinnamon and clover, whose smoky quality adds texture. An ideal companion for cocktails.','Original Dark Rum' , 10, 750, 'PLANTATION', 'PUERTO_RICO', 'AGED_RUM', 63);
--insert into rum_product values(472, 23, 40, 'JAMAICA', 'Plantation 3 Stars is a tribute to the historic rums produced in the Caribbean, with a suave blend of the region''s three primary terriors: Barbados, Jamaica and Trinidad. While Barbados delivers richness and a balanced palate, Trindad adds finese and Jamaica provides an emphatic structure. A perfect rum for Daiquiris.','Plantation 3 Stars Rum' , 10, 750, 'PLANTATION', 'PUERTO_RICO', 'WHITE_RUM', 47);
--insert into rum_product values(473, 10, 40, 'JAMAICA', 'First aged in bourbon casks in Barbados for many years, this rum is then sailed across the ocean in barrels to the southwest of France to be further matured in small Ferrand French oak casks. This centuries-old ''double ageing'' process imparts incredible smoothness and complexity. It unveils a sophisticated palette of chocolate, vanilla, ripe banana, roasted coconut, and a hint of fresh mango notes. With a remarkably long finish, Plantation XO 20th Anniversary is truly a rum to savor. ','Plantation XO 20th Anniversary Rum' , 10, 750, 'PLANTATION', 'PUERTO_RICO', 'AGED_RUM', 53);

