--insert into tequila_product values(478, 20, 40, 'MEXICO', 'Just as your unique personality was molded as the result of a lifetime of experiences and influences, it takes time to craft an amazing and original tequila. Aldez Reposado spends 8 months enjoying a journey of self-discovery as it ages and absorbs the bold and rich influences of reclaimed bourbon casks.','Organic Tequila Reposado' , 10, 750, 'ALDEZ', 'JALISCO', 'REPOSADO', 40);
--insert into tequila_product values(479, 20, 40, 'MEXICO', 'Life is a blank slate – filled with possibilities and potential. It falls on us to take each step of our journey and turn those myriad possibilities into the reality we desire. And that desire is at the heart of Aldez Blanco. After the second distillation, the “heart” of the liquid is kept in stainless steel tanks for over 10 months before being bottled. This allows the liquid to rest, producing an unaged tequila that is bold, balanced and smooth.','Aldez Organic Tequila Blanco' , 10, 750, 'ALDEZ', 'JALISCO', 'BLANCO', 40);
--insert into tequila_product values(480, 20, 40, 'MEXICO', 'All of the most significant accomplishments that life has to offer require the ingredients of time and patience. For those willing to wait until the right moment, amazing possibilities exist. It is no different for Aldez Añejo. Spending 18 months soaking up rich and complex flavors from reclaimed bourbon casks, our Añejo is symbolic of the amazing achievements that await those who are willing to invest the time it takes to develop true greatness.','Aldez Organic Tequila Añejo' , 10, 750, 'ALDEZ', 'JALISCO', 'ANEJO', 40);
--insert into tequila_product values(481, 20, 40, 'MEXICO', 'Aldez Tequila is a responsibly sourced, artisanal brand produced from 100% blue agaves that are hand selected from the organic fields of a single estate in the lowlands of Jalisco, Mexico. Being Certified Organic (both in the US and Europe) means Aldez Tequila is pure, untouched and unmanipulated. There is no glycerin, artificial flavoring or coloring in our liquid. In addition, Aldez Tequila prides itself in being eco-friendly. By using recycled glass, labels and corks, we strive to minimize our impact on the environment. ','Aldez Organic Tequila "The Organic Trio"' , 10, 750, 'ALDEZ', 'JALISCO', 'ANEJO', 40);
--insert into tequila_product values(494, 3, 40, 'MEXICO', 'Astral Tequila Reposado is made with 100% Blue Weber agave, nourished with good energy from the sun and stars. Astral Tequila believes that the more good energy we put into our world, the more good energy goes around. Astral actions their sustainability commitment by upcycling the agave fibers after distillation into adobe bricks which will be used to build homes and community centers in Jalisco, Mexico. This premium tequila has been aged in American Oak bourbon barrels and features notes of agave, caramel, and oak on the palate. Best enjoyed on the rocks or in a variety of cocktails fit for any occasion. Astral makes the perfect tequila gift for friends and family. ','Astral Tequila Reposado' , 10, 750, 'ASTRAL', 'JALISCO', 'REPOSADO', 40);
--insert into tequila_product values(495, 2, 40, 'MEXICO', 'Astral Tequila Anejo is made with 100% Blue Weber agave, nourished with good energy from the sun and stars. Astral Tequila believes that the more good energy we put into our world, the more good energy goes around. Astral actions their sustainability commitment by upcycling the agave fibers after distillation into adobe bricks which will be used to build homes and community centers in Jalisco, Mexico. This premium tequila has been aged for 12 months in American Oak bourbon barrels and features notes of vanilla, butterscotch, and oak on the palate. Best enjoyed in an old fashioned or in a variety of cocktails fit for any occasion. Astral makes the perfect tequila gift for friends and family.','Astral Tequila Añejo' , 10, 750, 'ASTRAL', 'JALISCO', 'REPOSADO', 40);
--insert into tequila_product values(496, 1, 40, 'MEXICO', 'Astral Tequila Blanco is made with 100% Blue Weber agave, nourished with good energy from the sun and stars. Astral Tequila believes that the more good energy we put into our world, the more good energy goes around. Astral actions their sustainability commitment by upcycling the agave fibers after distillation into adobe bricks which will be used to build homes and community centers in Jalisco, Mexico. This premium tequila features notes of citrus, clover honey, bright white pepper, agave, and tropical fruit on the palate. Best enjoyed in a classic margarita or in a variety of cocktails fit for any occasion. Astral makes the perfect tequila gift for friends and family.','Astral Blanco Tequila' , 10, 750, 'ASTRAL', 'JALISCO', 'REPOSADO', 40);
--insert into tequila_product values(499, 3, 40, 'MEXICO', 'Astral Tequila Reposado is made with 100% Blue Weber agave, nourished with good energy from the sun and stars. Astral Tequila believes that the more good energy we put into our world, the more good energy goes around. Astral actions their sustainability commitment by upcycling the agave fibers after distillation into adobe bricks which will be used to build homes and community centers in Jalisco, Mexico. This premium tequila has been aged in American Oak bourbon barrels and features notes of agave, caramel, and oak on the palate. Best enjoyed on the rocks or in a variety of cocktails fit for any occasion. Astral makes the perfect tequila gift for friends and family. ','Astral Tequila Reposado' , 10, 750, 'ASTRAL', 'JALISCO', 'REPOSADO', 40);
--insert into tequila_product values(500, 2, 40, 'MEXICO', 'Astral Tequila Anejo is made with 100% Blue Weber agave, nourished with good energy from the sun and stars. Astral Tequila believes that the more good energy we put into our world, the more good energy goes around. Astral actions their sustainability commitment by upcycling the agave fibers after distillation into adobe bricks which will be used to build homes and community centers in Jalisco, Mexico. This premium tequila has been aged for 12 months in American Oak bourbon barrels and features notes of vanilla, butterscotch, and oak on the palate. Best enjoyed in an old fashioned or in a variety of cocktails fit for any occasion. Astral makes the perfect tequila gift for friends and family.','Astral Tequila Añejo' , 10, 750, 'ASTRAL', 'JALISCO', 'REPOSADO', 40);
--insert into tequila_product values(501, 1, 40, 'MEXICO', 'Astral Tequila Blanco is made with 100% Blue Weber agave, nourished with good energy from the sun and stars. Astral Tequila believes that the more good energy we put into our world, the more good energy goes around. Astral actions their sustainability commitment by upcycling the agave fibers after distillation into adobe bricks which will be used to build homes and community centers in Jalisco, Mexico. This premium tequila features notes of citrus, clover honey, bright white pepper, agave, and tropical fruit on the palate. Best enjoyed in a classic margarita or in a variety of cocktails fit for any occasion. Astral makes the perfect tequila gift for friends and family.','Astral Blanco Tequila' , 10, 750, 'ASTRAL', 'JALISCO', 'REPOSADO', 40);
--insert into tequila_product values(504, 1, 40, 'MEXICO', 'Slow baked in clay ovens, naturally fermented and double distilled in stainless steel pot stills, our finished product then rests for a minimum of six months in new American White Oak barrels. This transformation allows the product to obtain its exceptional taste and golden hue through a natural process.','Casa México Tequila Reposado' , 10, 750, 'CASA_MEXICO', 'JALISCO', 'REPOSADO', 40);
--insert into tequila_product values(505, 1, 40, 'MEXICO', 'Our award winning Añejo is made from only the finest blue agave picked from the mineral rich, deep volcanic soils of the highlands in Jalisco, Mexico.','Casa México Tequila Añejo' , 10, 750, 'CASA_MEXICO', 'JALISCO', 'REPOSADO', 40);
--insert into tequila_product values(510, 20, 40, 'MEXICO', 'AN AÑEJO TEQUILA - aged in American Oak for at least 12 months, then filtered through activated charcoal. This process removes the color whilst softening & mellowing the yet still complex Añejo flavor.','Cenote™ Cristalino Tequila' , 10, 750, 'CENOTE', 'GUANAJUATO', 'CRISTALINO', 40);
--insert into tequila_product values(511, 20, 40, 'MEXICO', 'AWARD WINNING MEXICAN TEQUILA – Cenote artisan tequilas are masterfully crafted with 100% hand-picked Blue Weber Agave and the purest water, delivering tequila with a soul. OAK MELLOWED FOR 3 WEEKS –in American Oak ex-bourbon barrels before bottling, giving incredible smoothness and adding a subtle depth of flavor.','Cenote™ Blanco Tequila' , 10, 750, 'CENOTE', 'GUANAJUATO', 'CRISTALINO', 40);
--insert into tequila_product values(512, 20, 40, 'MEXICO', 'AWARD WINNING MEXICAN TEQUILA – Cenote artisan tequilas are masterfully crafted with 100% hand-picked Blue Weber Agave and the purest water, delivering tequila with a soul.','Cenote™ Añejo Tequila' , 10, 750, 'CENOTE', 'GUANAJUATO', 'CRISTALINO', 40);
--insert into tequila_product values(513, 20, 40, 'MEXICO', 'AWARD WINNING MEXICAN TEQUILA – Cenote artisan tequilas are masterfully crafted with 100% hand-picked Blue Weber Agave and the purest water, delivering tequila with a soul.','Cenote™ Sac Actun Tequila' , 10, 750, 'CENOTE', 'GUANAJUATO', 'CRISTALINO', 40);
--insert into tequila_product values(522, 20, 40, 'MEXICO', 'Tequila Herradura Reposado is the world''s very first reposado tequila. It is aged for 11 months, longer than industry standards, in charred American white oak barrels. The additional resting time results in a rich amber tequila liquor with notes of cooked agave, vanilla and butter complemented by a smooth and sweet finish with a touch of spice.','Tequila Herradura Reposado' , 10, 750, 'HERRADURA', 'GUANAJUATO', 'ORIGINAL_TEQUILA', 40);
--insert into tequila_product values(523, 20, 40, 'MEXICO', 'Double-rested for unmatched taste. Herradura Double Barrel Reposado is the product of a novel, two-step aging process. The first involves resting the tequila in charred American white oak barrels for 11 months. It''s then moved to new charred barrels and aged for an additional 30 days. This creates a rich, dark amber-colored liquid and a smooth yet complex flavor profile not found in any other Reposado, with hints of cooked agave, vanilla, allspice, clove, and oak.','Tequila Herradura Double Barrel Reposado S1B58' , 10, 750, 'HERRADURA', 'GUANAJUATO', 'EXTRA_ANEJO', 40);
--insert into tequila_product values(524, 20, 40, 'MEXICO', 'Our fourth and latest edition, Herradura Colección de la Casa Reserva 2015, Directo de Alambique, is made from 100% Blue agave, picked at peak-ripeness without barrel aging. This limited run tequila showcases a fresh, natural flavor. Its aroma is abundant with sweet apple and green pear, with a balanced palate of sweet agave, dried fruit and a hint of herbs and spices. Directo is a smooth, complex and lingering experience. Tequila connoisseurs seeking a bold expression, look no further. ','Herradura Directo de Alambique' , 10, 750, 'HERRADURA', 'GUANAJUATO', 'ORIGINAL_TEQUILA', 40);
--insert into tequila_product values(525, 20, 40, 'MEXICO', 'Tequila Herradura Silver is a tequila that is barrel aged for 45 days beyond industry standards. The prolonged aging process in American white oak barrels results in a light straw-colored tequila liquor with a robust, unique aroma full of cooked agave with vanilla and wood notes. Tequila Herradura Silver is enjoyable neat, on the rocks, in alcohol drinks, or as a base for classic cocktails such as a Horseshoe Margarita or a Classic Paloma.','Tequila Herradura Silver' , 10, 750, 'HERRADURA', 'GUANAJUATO', 'EXTRA_ANEJO', 40);
--insert into tequila_product values(526, 20, 40, 'MEXICO', 'Tequila Herradura Selección Suprema is the finest expression of tequila, and the very first Extra Añejo expression in the world. Selección Suprema is made from 100% agave and produced following time-honored techniques that elevate the craft of premium tequila to heights not found anywhere else.','Tequila Herradura Selección Suprema' , 10, 750, 'HERRADURA', 'GUANAJUATO', 'ORIGINAL_TEQUILA', 40);
--insert into tequila_product values(527, 20, 40, 'MEXICO', 'Tequila Herradura Legend is a unique Añejo tequila aged in new, heavily charred and grooved American White Oak barrels. Made from the finest 100% blue agave, naturally fermented, distilled and then matured for 14 months in heavily charred, new American White Oak barrels. These special barrels have been deeply grooved, exposing the tequila to more layers of toasted oak, as it patiently ages resulting in a special Añejo tequila with an incredibly rich, deep color and a luxurious and velvety smooth taste. Best enjoyed neat in a flute glass, or with a few droplets of water.','Tequila Herradura Legend' , 10, 750, 'HERRADURA', 'GUANAJUATO', 'EXTRA_ANEJO', 40);
--insert into tequila_product values(528, 20, 40, 'MEXICO', 'Tequila Herradura Añejo is aged to perfection for 25 months in American white oak barrels, which is an incredible 13 months beyond industry standards to create a tequila with a remarkably smooth taste. This process results in a dark amber-colored tequila liquor with aromas of cooked agave blended with spice and floral notes.','Tequila Herradura Ultra Cristalino Añejo' , 10, 750, 'HERRADURA', 'GUANAJUATO', 'ORIGINAL_TEQUILA', 40);
--insert into tequila_product values(529, 20, 40, 'MEXICO', 'Each tequila bottle delivers notes of cooked agave, toasted oak and dried fruit; a rich flavor with a smooth, creamy finish. Tequila Herradura Añejo is perfect for sipping neat, on the rocks or mixing into delicious mixed drinks and cocktails, such as a Horseshoe Margarita or a Classic Paloma.','Tequila Herradura Añejo' , 10, 750, 'HERRADURA', 'GUANAJUATO', 'EXTRA_ANEJO', 40);
--insert into tequila_product values(539, 20, 40, 'MEXICO', 'Tequila Herradura Añejo is aged to perfection for 25 months in American white oak barrels, which is an incredible 13 months beyond industry standards to create a tequila with a remarkably smooth taste. This process results in a dark amber-colored tequila liquor with aromas of cooked agave blended with spice and floral notes.','Tequila Herradura Añejo' , 10, 750, 'JOSE_CUERVO', 'GUANAJUATO', 'BLANCO', 28);
--insert into tequila_product values(540, 20, 40, 'MEXICO', 'Reserva de la Familia® is the Cuervo family’s award-winning 100% blue agave extra-añejo tequila made in limited quantities. DOUBLE GOLD MEDAL winner at San Francisco World Spirits Competition 2019. The superb spirit is dark amber in color with an aroma of oak, almonds, apples, olives and cinnamon.','Jose Cuervo Reserva de la Familia® Extra Añejo' , 10, 750, 'JOSE_CUERVO', 'GUANAJUATO', 'BLANCO', 35);
--insert into tequila_product values(541, 20, 40, 'MEXICO', 'Jose Cuervo® Tradicional® Cristalino is an exclusive blend of three aged tequilas: Tradicional® Reposado and Añejo, each aged in new American oak, and Reserva de la Familia® Extra Añejo, aged in French and American oak. Filtered to remove the liquid’s color, while intensifying its purity of flavors. The result is a crystal clear, sipping tequila of exceptional smoothness. Packaged in a stylish bottle, this Cristalino is perfect for tequila lovers looking to share elegance and finesse with others. (40% ABV-80 proof).','Jose Cuervo® Tradicional® Cristalino' , 10, 750, 'JOSE_CUERVO', 'GUANAJUATO', 'BLANCO', 95);
--insert into tequila_product values(542, 20, 40, 'MEXICO', 'Artisanal Jose Cuervo Tradicional® Reposado is distilled from select 100% blue agave rested in charred oak and is very “tequilero” in character. It is light straw in color and has an herbaceous essence of agave. Its flavor is of cooked agave and stewed tropical fruits backed by lingering notes of vanilla, clove, cinnamon, and toffee (40% ABV-80 proof).','Jose Cuervo Tradicional® Reposado' , 10, 750, 'JOSE_CUERVO', 'GUANAJUATO', 'BLANCO', 36);
--insert into tequila_product values(543, 20, 40, 'MEXICO', 'Tradicional® Añejo is 100% blue agave tequila aged in charred American oak, then finished in Irish single malt whiskey barrels. It is the pinnacle of the Jose Cuervo Tradicional line, which has been masterfully honed over 200 years. Carried out completely in the artisanal tradition developed by Jose Antonio de Cuervo: cooking the agave in clay ovens and distilling the tequila in copper stills. (40% ABV-80 proof)','Jose Cuervo Tradicional Añejo' , 10, 750, 'JOSE_CUERVO', 'GUANAJUATO', 'BLANCO', 95);
--insert into tequila_product values(544, 20, 40, 'MEXICO', 'Reserva de la Familia® Reposado earns its rich and sophisticated qualities through a unique barrel aging process that employs three different types of wood and barrel toasting styles. Heavily-toasted American oak contributes baked spices, while lightly toasted American and French oaks bring forward mellow flavors of toffee and vanilla.','Jose Cuervo Reserva De La Familia® Reposado' , 10, 750, 'JOSE_CUERVO', 'GUANAJUATO', 'BLANCO', 84);
--insert into tequila_product values(545, 20, 40, 'MEXICO', 'The original tequila created over 200 years ago! Jose Cuervo® Tradicional® Silver is a multiple award winning, 100% blue agave tequila. GOLD MEDAL winner at San Francisco World Spirit Competition 2019. Herbaceous blue agave in aroma with subtle citrus notes. Spice and sweet balance, firmness and fruit overtones within its flavor profile, with a sweet and refreshing finish.','Jose Cuervo Tradicional® Silver' , 10, 750, 'JOSE_CUERVO', 'GUANAJUATO', 'BLANCO', 53);
--insert into tequila_product values(546, 20, 40, 'MEXICO', 'The #1 tequila brand in the world, Jose Cuervo Especial® Gold is a golden blend of younger tequilas. The light gold spirit has a sweet aroma with pleasant agave notes. Along with its sweet, subtle agave flavor and hints of oak and vanilla, Especial Gold boasts a well-balanced, short, smooth finish. (40% ABV-80 proof)','Jose Cuervo Especial Gold Tequila' , 10, 750, 'JOSE_CUERVO', 'GUANAJUATO', 'BLANCO', 38);
--insert into tequila_product values(547, 20, 40, 'MEXICO', 'This limited edition commemorates the historic birth of tequila production and eleven generations of Cuervo family tradition. In commemoration of the 250th anniversary, Jose Cuervo® 250 Aniversario is an ultra-rare 100% blue agave extra añejo tequila blended from the most select tequilas in the family’s reserve and aged in a unique double-cask method.','Jose Cuervo® 250 Aniversario' , 10, 750, 'JOSE_CUERVO', 'GUANAJUATO', 'BLANCO', 49);
--insert into tequila_product values(550, 20, 40, 'MEXICO', 'Aged to taste, not time, our Tequila Corrido Reposado deserves all the recognition it receives. The translation of reposado means “rested,” and like the name implies, our Tequila Reposado rests for about six months in our proprietary symphony barrels comprised of Hungarian, Limousine and Missouri oak.','Tequila Corrido Blanco' , 10, 750, 'TEQUILA_CORRIDO', 'JALISCO', 'CRISTALINO', 64);
--insert into tequila_product values(551, 20, 40, 'MEXICO', 'It’s love at first sip with our luxurious Tequila Corrido Blanco. This balanced beauty is best enjoyed neat but still shines as the main act with any mixer it mingles with. Rested for 30 days for harmonization and always 100 percent additive free, it''s tequila in its purest form.','Tequila Corrido Anejo' , 10, 750, 'TEQUILA_CORRIDO', 'JALISCO', 'ORIGINAL_TEQUILA', 58);
--insert into tequila_product values(552, 20, 40, 'MEXICO', 'Meticulously handcrafted in every way, our Tequila Corrido Añejo is a true aficionado’s sipping tequila. This seductive and sophisticated tequila is aged for six months in Mexican merlot wine barrels from Valle de Guadalupe and then finished for 12 months in hand selected symphony barrels.','Tequila Corrido Reposado' , 10, 750, 'TEQUILA_CORRIDO', 'JALISCO', 'ORIGINAL_TEQUILA', 38);
--insert into tequila_product values(554, 20, 40, 'MEXICO', 'Celebrate the sixth season of TV series Silicon Valley with a pour of Tres Comas Añejo Tequila, created in partnership with Silicon Valley and HBO. This ultra-premium tequila is aged in American oak barrels at a family-run distillery in Jalisco, Mexico. Ripe agave and sweet spice open to reveal caramelized toasted oak in the mid palate balanced with the fruity and spicy essence of pink peppercorn. The finish is smooth and silky yet rich and bold enough to hold its ground as a sophisticated añejo tequila. Our limited release is perfect for Silicon Valley watch parties or as a gift for a fan of the series. The subtle notes of vanilla, spice and toasted oak on the finish are best enjoyed neat or on the rocks. Includes one 80 proof 750 mL bottle of Tres Comas Añejo Tequila.','Tres Comas Añejo' , 10, 750, 'TRES_COMAS', 'JALISCO', 'ORIGINAL_TEQUILA', 40);
--insert into tequila_product values(561, 1, 40, 'MEXICO', 'Corralejo crafts authentically Mexican tequila that over delivers on taste. Whether you’re making a round of margaritas or ordering shots to get the celebration started, Corralejo draws people together and sets the tone for a lively and vibrant experience.Made from 100% Blue Weber Agave, Corralejo Ańejo is double distilled and aged for twelve months in charred American oak barrels. ','Corralejo Reposado' , 10, 750, 'CORRALEJO_TEQUILA', 'GUANAJUATO', 'ORIGINAL_TEQUILA', 46);
--insert into tequila_product values(562, 3, 40, 'MEXICO', '99,000 hours, 4,125 days, 11.3 years – no matter how you count it, we take our time when it comes to crafting 99,000 Horas. We believe great tequila comes from attention to detail at every step of production. Tequila is more than the fertile soil the agave is born from, the perfect timing of the harvest, the slow roasting of the piñas, or the selected wood the tequila is aged in.','Corralejo Extra Añejo 3 Year' , 10, 750, 'CORRALEJO_TEQUILA', 'GUANAJUATO', 'ORIGINAL_TEQUILA', 63);
--insert into tequila_product values(563, 1, 40, 'MEXICO', '99,000 Horas is greater than the sum of its parts. We artfully combine the finest methods of agave cultivation, harvest, distillation, aging, and bottling to bring you a tequila that is 99,000 hours in the making. Crafted from 100% blue agave, 99,000 Horas is double-distilled using the Charentais method in copper stills and then gracefully aged for 18 months in small oak barrels.','Corralejo 99,000 Horas Añejo Tequila' , 10, 750, 'CORRALEJO_TEQUILA', 'GUANAJUATO', 'ORIGINAL_TEQUILA', 48);
--insert into tequila_product values(564, 1, 40, 'MEXICO', 'Corralejo crafts authentically Mexican tequila that over-delivers on taste. Whether you’re making a round of margaritas or ordering shots to get the celebration started, Corralejo draws people together and sets the tone for a lively and vibrant experience.','Corralejo Silver' , 10, 750, 'CORRALEJO_TEQUILA', 'GUANAJUATO', 'ORIGINAL_TEQUILA', 59);
--insert into tequila_product values(565, 1, 40, 'MEXICO', 'Corralejo crafts authentically Mexican tequila that over-delivers on taste. Whether you’re making a round of margaritas or ordering shots to get the celebration started, Corralejo draws people together and sets the tone for a lively and vibrant experience.','Corralejo Añejo' , 10, 750, 'CORRALEJO_TEQUILA', 'GUANAJUATO', 'ORIGINAL_TEQUILA', 25);
--insert into tequila_product values(566, 1, 40, 'MEXICO', 'Corralejo’s 1821 honors Mexico’s rich history and hard-fought independence inspired by Don Miguel Hidalgo y Costilla, a noble priest born at Hacienda Corralejo. This special release of Extra Anejo tequila is produced with only the finest agave and aged for 36 months in American oak barrels. The result is a rich amber liquid with notes of vanilla, almond and cooked agave. An expression of the finest craftsmanship, Corralejo 1821 celebrates those who stand stall with pride.','Corralejo 1821 Extra Anejo Tequila' , 10, 750, 'CORRALEJO_TEQUILA', 'GUANAJUATO', 'ORIGINAL_TEQUILA', 96);


