--insert into liqueur_product values(570, 1, 17, 'UNITED_STATES', 'An exquisitely balanced vermouth, full-bodied and pleasantly brisk with a heady aroma of herbs, fruit, and spice. Satisfying on the rocks and suited to any cocktail calling for sweet vermouth.','Accompani Sweet Vermouth' , 10, 500, 'ACCOMPANI', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 75);
--insert into liqueur_product values(571, 1, 17, 'UNITED_STATES', 'An exquisitely balanced vermouth, full-bodied and pleasantly brisk with a heady aroma of herbs, fruit, and spice. Satisfying on the rocks and suited to any cocktail calling for sweet vermouth.','Blue Dorris' , 10, 500, 'ACCOMPANI', 'KENTUCKY', 'DESSERT_COFFEE', 75);
--insert into liqueur_product values(572, 1, 17, 'UNITED_STATES', 'An exquisitely balanced vermouth, full-bodied and pleasantly brisk with a heady aroma of herbs, fruit, and spice. Satisfying on the rocks and suited to any cocktail calling for sweet vermouth.','Accompani Flora Green' , 10, 500, 'ACCOMPANI', 'KENTUCKY', 'DESSERT_COFFEE', 75);
--insert into liqueur_product values(575, 1, 17, 'ITALY', 'The new Carpano Dry Vermouth comes from a legendary and centuries-old vermouth producer of Italy. The quality of their vermouth is unquestioned and a favorite of bartenders worldwide. This herbaceous and spice-forward formula calls on both wormwood and a native herb from Crete for balanced bitterness, while citrus notes smooth out the finish. ','Carpano Dry' , 10, 500, 'CARPANO', 'KENTUCKY', 'VERMOUTH', 37);
--insert into liqueur_product values(576, 1, 17, 'ITALY', 'Carpano Antica Formula is made from the Carpano Distillery''s "ancient formula" for (red) sweet vermouth. Carpano Antica Formula is sought after because of its heritage, packaging and refined taste. It is distinguished from other sweet vermouths by its hint of vanilla flavor and aroma. The authentic nature of this vermouth is enhanced by using copies of the original 18th Century label and bottle, with the traditional cork and red seal.','Carpano Antica Formula' , 10, 500, 'CARPANO', 'KENTUCKY', 'VERMOUTH', 85);
--insert into liqueur_product values(577, 1, 17, 'UNITED_STATES', 'Cinzano, established in 1757, with over 250 years of heritage behind it, is one of the most historic brands for vermouth and sparkling wine.','Cinzano Vermouth Bianco' , 10, 500, 'CINZANO', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 75);
--insert into liqueur_product values(581, 1, 17, 'ITALY', 'Foro Vermouth hails from the Piemonte region in Italy and is the perfect aperitif due to its unparalleled quality and unique herbal characteristics. Foro Vermouth can be enjoyed straight, on the rocks, or in a wide range of cocktails.','Foro Rosso Vermouth Di Torino' , 10, 500, 'FORO', 'KENTUCKY', 'VERMOUTH', 75);
--insert into liqueur_product values(582, 1, 17, 'ITALY', 'Foro Vermouth hails from the Piemonte region in Italy and is the perfect aperitif due to its unparalleled quality and unique herbal characteristics. Foro Vermouth can be enjoyed straight, on the rocks, or in a wide range of cocktails.','Foro Dry Vermouth Di Torino' , 10, 500, 'FORO', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 75);
--insert into liqueur_product values(583, 1, 17, 'ITALY', 'Deliciously intense with chocolate overtones, Foro Amaro is made in a way that honors the tradition and allure of the Italian countryside. We hand select over 25 botanicals including Angelica Root, Hibiscus, Gentian, Sage, and Marjoram, which are then steeped in a distinctive spirit base infused with the scented rinds of mandarin oranges and Italian lemons from the sun kissed fields of Italy.','Foro Amaro Speciale' , 10, 500, 'FORO', 'KENTUCKY', 'CREAM_LIQUEUR', 75);
--insert into liqueur_product values(591, 1, 17, 'ITALY', 'MARTINI & ROSSI Riserva Speciale Ambrato Vermouth is a dry vermouth that''s named for its rich amber color. This dry white vermouth cocktail mixer is made with 100% Italian grapes primarily sourced from the local Piedmont region, including small parcels of Asti Moscato Bianco. Made with quality ingredients, this vermouth is made with three types of artemisia and unique botanicals including yellow cinchona, Chinese rhubarb and Roman chamomile.','Martini Riserva Speciale Ambrato' , 10, 500, 'MARTINI_ROSSI', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 84);
--insert into liqueur_product values(592, 1, 17, 'ITALY', 'MARTINI & ROSSI Bianco Vermouth is a white vermouth that owns up to its fashionable namesake for the authentically open-hearted drinker. This dry vermouth has a unique base made from white wines, like Trebbiano, that is graced with extracts of aromatic herbs and flowers. Made with quality ingredients, this dry white vermouth displays a wealth of flavor with soft vanilla notes and a recognizable taste.','Martini Bianco' , 10, 500, 'MARTINI_ROSSI', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 63);
--insert into liqueur_product values(593, 1, 17, 'ITALY', 'MARTINI & ROSSI Extra Dry Vermouth Cocktail Mixer is a dry white vermouth that owns up to its fashionable namesake for the authentically open-hearted drinker. This white vermouth captures the essence of the rare woods, herbs and citrus that makes up the secret recipe, crafted using hand-selected botanicals from across the world’s gardens. Made with quality ingredients, this vermouth displays tart, violet-scented notes and a bright finish.','Martini Extra Dry' , 10, 500, 'MARTINI_ROSSI', 'KENTUCKY', 'DESSERT_COFFEE', 58);
--insert into liqueur_product values(594, 1, 17, 'ITALY', 'Martini & Rossi Rosso Vermouth is created with a secret blend of wines and a selection from 40 botanicals that give it a distinctive sweet taste, with subtle hints of orange and citrus. Its distinctive red color comes from the caramel used in Martini & Rossi Vermouth''s unique blending process. Artemisia is a crucial ingredient in the distilling of this unique sweet vermouth and continues to be grown and harvested just a few miles south of Pessione.','Martini & Rossi Rosso' , 10, 500, 'MARTINI_ROSSI', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 36);
--insert into liqueur_product values(595, 1, 17, 'ITALY', 'Made with 100% Natural Color & Flavor, Martini & Rossi Fiero is a refreshingly low-ABV drink with flavors of hand cut sweet Spanish oranges from Murica Spain. Each orange is peel is hand cut into long strips and spread on linen threads left to dry naturally under the Italian sun. This craft method is laborious and produces small quantities but allows us to keep intact most of essential oils contained in the peel.','Martini & Rossi Fiero Aperitivo' , 10, 500, 'MARTINI_ROSSI', 'KENTUCKY', 'DESSERT_COFFEE', 86);
--insert into liqueur_product values(596, 1, 17, 'ITALY', 'MARTINI & ROSSI Riserva Speciale Rubino Vermouth is a sweet red vermouth named after its rich ruby color. This sweet vermouth features peppery notes that pay homage to Genova, the home of the Italian spice trade. Made with quality ingredients, this vermouth uses great Italian wines like Nebbiolo DOC in its recipe and features specially hand-selected botanicals, such as three types of artemisia.','Martini Riserva Speciale Rubino' , 10, 500, 'MARTINI_ROSSI', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 92);
--insert into liqueur_product values(597, 1, 17, 'ITALY', 'MARTINI & ROSSI Bitter Liqueur was inspired by the original 1872 recipe and is made with 100% natural ingredients. It is characterized by three rare botanicals (Saffron, Angostura and Columba), that deliver a unique richness and complexity to its taste profile. To ensure that all of our aromatic ingredients are blended and harmonized,  our Bitter is rested in traditional Piedmontese Tino casks.','Martini & Rossi Riserva Speciale Bitter Liqueur' , 10, 500, 'MARTINI_ROSSI', 'KENTUCKY', 'DESSERT_COFFEE', 74);
--insert into liqueur_product values(606, 1, 17, 'IRELAND', 'Celebrate springtime with Baileys Vanilla Mint Shake Irish Cream Liqueur. Our 34 proof limited edition flavor celebrates the arrival of Spring with a unique take on an American classic. Baileys Vanilla Mint Shake Irish Cream Liqueur has a mint and creamy vanilla aroma, with notes of rich vanilla bean, mint, and cocoa on the palate. Best enjoyed straight as a shot or blended into an indulgent adult milkshake.','Baileys Vanilla Mint Shake Irish Cream Liqueur' , 10, 500, 'BAILEYS', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 42);
--insert into liqueur_product values(607, 1, 17, 'IRELAND', 'Our 34 proof liqueur is the perfect marriage of premium Irish dairy cream and a unique chocolate and vanilla blend for a decadent taste. The blend of spirits and whiskey uniquely preserves the classic taste of the Irish cream and is perfect in coffee or in a hot chocolate. Simply pour over ice cream for an indulgent dessert.','Baileys Original' , 10, 500, 'BAILEYS', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 95);
--insert into liqueur_product values(608, 1, 17, 'IRELAND', 'Baileys Almande Almondmilk Liqueur brings a light-tasting side of indulgence to any celebration. This smooth spirit blends the luscious, nutty flavors of real almond milk and real vanilla to create a versatile drink. To enjoy, mix with coconut water for a delicious summer cocktail.','Baileys Almande' , 10, 500, 'BAILEYS', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 25);
--insert into liqueur_product values(609, 1, 17, 'IRELAND', 'Savor the nostalgic flavors of toasted marshmallow, rich chocolate, and graham cracker with Baileys S’mores Irish Cream Liqueur. Our 34 proof Limited Edition liqueur celebrates your favorite bonfire treat. Baileys S’mores Liqueur combines the unmistakable taste of our Irish Cream with flavors of toasted marshmallows sandwiched between graham crackers and a melted chocolate finish for a sensational melt-in-your-mouth drink to elevate any occasion. Add indulgent flavor to your drinks by serving Baileys S’mores Liqueur over ice or in your favorite hot beverages.','Baileys S''mores Irish Cream Liqueur' , 10, 500, 'BAILEYS', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 58);
--insert into liqueur_product values(610, 1, 17, 'IRELAND', 'By blending fresh, juicy strawberries with pure Irish dairy cream and the unique Baileys spirit, Strawberries & Cream is perfect for a sweet dessert or in a mixed drink after dinner. Try serving over crushed ice or blended with coconut water for a light but indulgent springtime cocktail.','Baileys Strawberries and Cream' , 10, 500, 'BAILEYS', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 84);
--insert into liqueur_product values(611, 1, 17, 'IRELAND', 'Fall for autumn’s favorite flavors with Baileys Apple Pie Irish Cream Liqueur. Our 34 proof Limited Edition liqueur celebrates the timeless taste of Apple Pie a la mode. Baileys Apple Pie Irish Cream Liqueur combines the taste of Irish Cream Liqueur with the magical flavors of freshly baked apple pie and rich vanilla ice cream. Hints of cinnamon and spices lead to a creamy vanilla finish. Add festive flavor to your drinks by serving Baileys Apple Pie Irish Cream Liqueur over ice or in your favorite hot beverages. For an Apple Chai Tea Latte, combine with hot chai tea in a mug and garnish with a cinnamon stick.','Baileys Apple Pie Irish Cream Liqueur' , 10, 500, 'BAILEYS', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 52);
--insert into liqueur_product values(612, 1, 17, 'IRELAND', 'The little treats in life keep us going! We begin with our Irish cream, then blend in the delicious notes of vanilla cream cheese frosting and finish it with delicate cocoa notes of chocolate to perfectly replicate the indulgent taste of a delectable cupcake. This indulgent liqueur was awarded a double gold medal at the 2020 San Francisco World Spirits Competition. Simply add Baileys Red Velvet Irish Cream Liqueur, In Collaboration with Georgetown Cupcake to your favorite hot chocolate drink for velvety indulgence.','Baileys Red Velvet Irish Cream Liqueur, In Collaboration with Georgetown Cupcake' , 10, 500, 'BAILEYS', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 85);
--insert into liqueur_product values(613, 1, 17, 'IRELAND', 'Soak up the bliss of sunshine in a bottle with Baileys Colada Irish Cream Liqueur, a unique twist on a favorite tropical treat. Made with our irresistible Irish Cream and notes of tropical fruit, our 34 proof Limited Edition liqueur blends the flavors of sweet, creamy coconut with notes of juicy, ripe pineapple.','Baileys Colada Irish Cream Liqueur' , 10, 500, 'BAILEYS', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 85);
--insert into liqueur_product values(614, 1, 17, 'IRELAND', 'Indulge but keep it light with Baileys Deliciously Light. We''ve combined cream from Ireland and the rich cocoa and vanilla flavors of Baileys to create a sweet treat with 40% fewer calories and 40% fewer grams of sugar than Baileys Original Irish Cream.','Baileys Deliciously Light' , 10, 500, 'BAILEYS', 'KENTUCKY', 'SPICED_FLAVORED_RUM', 64);